title\":null,\"type\":\"entry\",\"value\":\"103\"}',NULL,NULL,NULL,NULL,NULL,'{\"titleRaw\":[],\"descriptionRaw\":\"\",\"keywords\":[],\"score\":\"neutral\",\"social\":{\"twitter\":{\"handle\":null,\"title\":\"Open Source Brain - MetaCell\",\"image\":null,\"description\":\"\"},\"facebook\":{\"handle\":null,\"title\":\"Open Source Brain - MetaCell\",\"image\":null,\"description\":\"\"}},\"advanced\":{\"robots\":[],\"canonical\":null}}'),(10,24,1,'Virtual Fly Brain','2019-02-09 20:52:25','2019-02-27 04:46:04','6595b2b6-d6ea-47d3-bf7e-b9e2092b9307','<p><a href=\"http://metacell.petrovdev.eu/downloadable/case-study-3\">Virtual Fly Brain (VFB)</a> is an interactive tool for neurobiologists to explore the detailed neuroanatomy, neuron connectivity and gene expression of Drosophila melanogaster. It integrates data from published literature and image datasets making it possible to run cross searches, find similar neurons and compare image data on a <a href=\"http://www.metacell.us/VFBCaseStudy.html\">3D Viewer</a>.</p>',NULL,NULL,'{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download Case Study\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"104\"}',NULL,NULL,NULL,NULL,NULL,'{\"titleRaw\":[],\"descriptionRaw\":\"\",\"keywords\":[],\"score\":\"neutral\",\"social\":{\"twitter\":{\"handle\":null,\"title\":\"Virtual Fly Brain - MetaCell\",\"image\":null,\"description\":\"\"},\"facebook\":{\"handle\":null,\"title\":\"Virtual Fly Brain - MetaCell\",\"image\":null,\"description\":\"\"}},\"advanced\":{\"robots\":[],\"canonical\":null}}'),(11,25,1,'NetPyNE UI','2019-02-09 20:52:51','2019-02-27 04:46:04','b8fb6196-2012-4889-9741-00e066c00bb1','<p><a href=\"http://netpyne.org/\">NetPyNE</a> is a python package to facilitate the development, parallel simulation and analysis of biological neuronal networks using the NEURON simulator. MetaCell significantly advanced the development of the <a href=\"https://github.com/MetaCell/NetPyNE-UI\">user interface of NetPyNE</a>, and recently released version 0.5.</p>',NULL,NULL,'{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download Case Study\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"198\"}',NULL,NULL,NULL,NULL,NULL,'{\"titleRaw\":[],\"descriptionRaw\":\"\",\"keywords\":[],\"score\":\"neutral\",\"social\":{\"twitter\":{\"handle\":null,\"title\":\"NetPyNE UI - MetaCell\",\"image\":null,\"description\":\"\"},\"facebook\":{\"handle\":null,\"title\":\"NetPyNE UI - MetaCell\",\"image\":null,\"description\":\"\"}},\"advanced\":{\"robots\":[],\"canonical\":null}}'),(12,26,1,'Test-text','2019-02-10 11:05:27','2019-02-10 11:05:27','513fd946-17c5-4535-8621-f997dcd4b530',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(13,27,1,'Test_PDF','2019-02-10 11:05:28','2019-02-10 11:05:28','9a13cee5-8b5d-47f2-bdd0-8490134da538',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(14,28,1,'Patient H.M.','2019-02-10 11:40:13','2019-02-10 11:40:13','26819418-0a4c-4139-9b98-045ca7d2793e',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(15,29,1,'Open Source Brain Teaser','2019-02-10 13:32:52','2019-02-10 13:32:52','af81050e-52c3-4d69-80e9-ffbfa555e550',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(17,31,1,'Open Source Brain Teaser','2019-02-10 14:14:09','2019-02-10 14:14:09','668f6b24-f6ca-4645-a750-da7cba926a7a',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(18,32,1,'The State University of New York','2019-02-10 15:48:54','2019-02-10 16:18:24','ff5d457f-ed24-4c0f-afb6-97d776aa201b',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(19,33,1,'University College London: Open Source Brain','2019-02-10 15:48:55','2019-02-10 16:18:43','c56057a2-1d1f-4a9a-b544-7454b4fde85a',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(20,34,1,'The University of Edinburg','2019-02-10 15:48:56','2019-02-10 16:18:00','fdf82855-cc0d-4620-8c56-69117abd27d5',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(21,35,1,'International Neuroinformatics Coordinating Facility','2019-02-10 15:48:57','2019-02-10 16:17:39','6cb9f6c7-09e7-411e-8305-badb4382f1d5',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(22,36,1,'University College London: Open Source Brain','2019-02-10 15:49:06','2019-02-10 15:49:06','bff1d1ae-622e-42a5-8715-9dcad1678b0d',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(23,37,1,'The State University of New York','2019-02-10 15:50:22','2019-02-10 16:27:29','bc14d307-d704-4744-bb8a-d629cd87d379',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(24,38,1,'The University of Edinburg','2019-02-10 15:51:17','2019-02-10 16:27:16','37c587b3-0481-486f-87c5-0de774051c24',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(25,39,1,'International Neuroinformatics Coordinating Facility','2019-02-10 15:52:11','2019-02-10 16:27:02','9ac7b766-6eeb-4bcf-b16f-6a7fa37929c8',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(26,41,1,'Icon-1','2019-02-10 17:27:39','2019-02-10 17:27:39','cf12157a-593e-43ec-8ca2-20e00a807a8a',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(27,42,1,'Icon-2','2019-02-10 17:27:40','2019-02-10 17:27:40','bc673d6d-2c6e-45da-b87a-b093b6c245c3',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(28,43,1,'Icon-3','2019-02-10 17:27:41','2019-02-10 17:27:41','9ad7c4fd-8525-4680-9d1c-c5d728305b58',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(29,48,1,'260x260','2019-02-10 18:27:18','2019-02-10 18:27:18','0b5de286-f990-4d79-91f3-9c0f75b6be01',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(30,49,1,'Stephen Larson','2019-02-10 18:29:40','2019-02-10 18:38:09','220047c5-6e1d-4063-8423-f1b96f46d24b',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(31,50,1,'Stephen Larson','2019-02-10 18:33:49','2019-02-16 09:29:58','7f872351-313d-49e2-9dd3-b719a2653ee0','<p>Stephen Larson, co-founder and CEO of MetaCell, is an expert on the intersection between computer technology and biological systems, and is interested in how computer systems can help us understand fundamental principles of life. Stephen serves as the Project Director for the OpenWorm Foundation. He served as the Chief Information Officer of One Mind for Research, a non-profit dedicated to eradicating brain disease by transforming the healthcare research system through public-private partnerships. He has worked as a professional software engineer for a major New York City investment bank, co-developed a patent, presented at more than two dozen forums, published in academic journals such as Frontiers in Neuroscience and Nature, and has had his work featured in the New York Times, The Atlantic, Wired, and MSNBC.com. His diverse educational background includes a bachelor of science and master of engineering from MIT in computer science as well as a PhD in neuroscience from the University of California, San Diego.</p>','{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"url\",\"value\":\"https://www.linkedin.com/in/stephendavidlarson/\"}','{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"email\",\"value\":\"stephen@metacell.us\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(32,51,1,'Giovanni Idili','2019-02-10 18:36:04','2019-02-10 18:36:22','589d99fb-a6da-4c78-a99a-470c9eee4f46',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(33,52,1,'Giovanni Idili','2019-02-10 18:36:36','2019-02-16 09:29:40','5e6c121a-b939-45fa-8135-1c24b1192c50','<p>Giovanni Idili. co-founder and COO of MetaCell, is an engineer and entrepreneur. Before founding MetaCell with Stephen and Matteo, Giovanni has worked as a software consultant for companies such as Rockwell Automation, Snap-on Diagnostics and 8 West Consulting. His professional experience focuses on getting projects off the ground and leading analysis and development of large scale software solutions, working with sizable teams. Throughout the years Giovanni co-founded two startups and a not for profit. Giovanni earned a Bachelor degree in Electronic Engineering at Università di Cagliari, Italy, in 2005, and a Master degree in Computer Science from Cork Institute of Technology, Ireland, in 2010. Within MetaCell Giovanni has evolved into a senior operations centric management role, overseeing the internals of the company as a whole, as well as running and staffing projects as needed.</p>','{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"url\",\"value\":\"https://www.linkedin.com/in/giovanniidili/\"}','{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"email\",\"value\":\"giovanni@metacell.us\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(34,53,1,'Matteo Cantarelli','2019-02-10 18:37:31','2019-02-10 18:37:41','35aaf972-d95a-4200-8a7b-d8001f18bc60',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(35,54,1,'Matteo Cantarelli','2019-02-10 18:37:58','2019-02-16 09:29:19','539b5822-a854-4821-9ce1-e6d22bfaac40','<p>Matteo Cantarelli, Founder and CTO of MetaCell, is a software architect and entrepreneur. In 2012 Matteo worked as Principal Research Associate with the Department of Neuroscience, Physiology and Pharmacology at the University College of London to build Open Source Brain, a resource to develop and share computational models of neurons. In 2011 he co-founded the OpenWorm Foundation which he now serves as Financial Director. Matteo published with the Royal Society of London, is inventor in an Interactive-Visual patent, and had his work featured on The Economist. In his early career Matteo worked as Senior Engineer for Pilz Ireland, leader in the industrial automation market. Matteo holds a master in systems Engineering from the École Normale Supérieure de Paris-Saclay (France) as well as a master and bachelor degree in electronic engineering from the University of Cagliari (Italy).</p>','{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"url\",\"value\":\"https://www.linkedin.com/in/matteocantarelli/\"}','{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"email\",\"value\":\"matteo@metacell.us\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(36,58,1,'One Mind For Research','2019-02-11 18:09:58','2019-02-11 18:39:00','09b1891b-1aaf-4c6d-8b50-b8ea017f8087',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(37,68,1,'One-Mind-For-Research','2019-02-11 18:25:00','2019-02-11 18:25:00','cde23f1b-b3cd-451d-96ca-14648d4494f0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(38,69,1,'One-Mind-For-Research','2019-02-11 18:38:56','2019-02-11 18:38:56','9f0dbf75-1727-4d20-a894-3e17f6e950f6',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(39,71,1,'Press Releases','2019-02-12 03:55:46','2019-02-12 03:55:46','5deb8154-d6b2-43d7-8948-d77064b2d5fd',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(40,72,1,'Webinars','2019-02-12 03:56:01','2019-02-12 03:56:01','eaa8f077-1eaf-4ed4-9a6e-79b18c4b37ec',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(41,73,1,'Big Data in the Nurosciences','2019-02-12 04:22:28','2019-02-27 04:41:35','48a88c25-202b-4a32-8a3f-8c965c044ff5','\n<figure><img src=\"{asset:97:url}\" alt=\"\" /></figure>\n<p>Nunc varius risus eu ipsum commodo, in mollis mauris iaculis. Nulla sapien nulla, luctus sit amet pulvinar vel, vehicula a purus. Proin cursus accumsan ornare. Nunc suscipit mi arcu, sed lacinia ex fringilla vel. Nam bibendum, magna sit amet maximus faucibus, elit diam malesuada dui, feugiat porttitor diam quam sit amet ex. Fusce dictum scelerisque massa, nec suscipit mi tempor eget. Cras ac suscipit nunc. Aliquam lobortis, augue efficitur pellentesque ultricies, nulla magna maximus est, in convallis sem nibh ut mi. Praesent mollis nulla nec faucibus faucibus. Phasellus id eros tellus.</p>\n<figure></figure>\n<figure></figure>\n<figure></figure>\n<figure></figure>\n<figure></figure>\n<figure></figure>\n<figure></figure>\n<p><br />Lorem ipsum dolor sit amet, consectetur adipiscing elit. N