\":\"\",\"keywords\":[],\"score\":\"neutral\",\"social\":{\"twitter\":{\"handle\":null,\"title\":\"Brain scan detect who has better skills - MetaCell\",\"image\":null,\"description\":\"\"},\"facebook\":{\"handle\":null,\"title\":\"Brain scan detect who has better skills - MetaCell\",\"image\":null,\"description\":\"\"}},\"advanced\":{\"robots\":[],\"canonical\":null}}'),(44,82,1,'The brain that change everything','2019-02-12 05:03:57','2019-02-27 04:41:35','e5c5569b-2bea-4f5a-9d4b-590adb89378b','<figure><img src=\"{asset:208:url}\" alt=\"\" /></figure>\n<p>Neuroscience is a field of study that confronts some of the deepest mysteries that human beings have ever grappled with. What is the nature of our consciousness? What goes wrong when mental disease strikes? How do we heal injuries of the brain? While scientists have begun to answer these questions, many answers are still far from our grasp.</p>\n<blockquote>\"From new molecular probes, to magnetic resonance imaging, to high-powered light and electron microscopes, to electrical recording, today, neuroscience is a discipline awash in data.\"</blockquote>\n<p><br /></p><p>Because the brain itself is so intricate in structure and dynamics, no single method of data collection captures all of its functional aspects. In addition, to gather data from the brain, non-overlapping scientific disciplines such as physics, chemistry, electrical engineering, and genetics are required. As a result, experimental data is often collected from a single dimension of measurement. This means that as soon as the data are collected, they are already in need of being interpreted in the context of some other data. For example, scalp EEG data is collected from multiple electrodes, often with the need to have the exact positions of those electrodes on the head. Analogously, an image of brain tissue taken from a fiber-optic microscope often requires knowing the 3D location in the brain where the image was taken. In these cases and in many others, the context provided by a second or third modality of data is very often critical to deriving the full benefit from the first.<br /></p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'{\"titleRaw\":[],\"descriptionRaw\":\"\",\"keywords\":[],\"score\":\"neutral\",\"social\":{\"twitter\":{\"handle\":null,\"title\":\"The brain that change everything - MetaCell\",\"image\":null,\"description\":\"\"},\"facebook\":{\"handle\":null,\"title\":\"The brain that change everything - MetaCell\",\"image\":null,\"description\":\"\"}},\"advanced\":{\"robots\":[],\"canonical\":null}}'),(45,83,1,'Interactive 3D Brain Data Browse','2019-02-12 05:05:47','2019-02-27 04:41:35','caaa7091-8e66-49c2-ad5a-c328cf18af14','<figure></figure><p>Vivamus eu pretium massa. Nullam vel nulla vitae lorem viverra tristique non non mi. Pellentesque dapibus ullamcorper sodales. Ut imperdiet luctus ornare. Praesent in metus quam. Etiam ornare massa non nisi fringilla facilisis. Nam et tempus orci. Vivamus ultricies elementum dapibus. Praesent orci nisi, imperdiet sed tempor a, ullamcorper in mauris. Suspendisse volutpat eros et commodo pharetra. Phasellus eget tincidunt felis, eu iaculis justo.</p>\n<figure></figure>\n<p>Suspendisse posuere turpis eget faucibus tristique. Cras eget facilisis nibh. Integer vitae viverra nisi. Nam quis orci vel massa ullamcorper consequat. Vestibulum sed ultricies libero. Nunc pharetra tellus ac sem hendrerit, nec mollis nulla dictum. Sed facilisis libero vitae tincidunt fermentum. Sed blandit ac sapien a placerat. Quisque hendrerit arcu non velit malesuada rhoncus. Nulla vestibulum leo nec lobortis sodales. Proin ac erat consectetur, scelerisque lectus ut, pulvinar ante. Phasellus sagittis gravida rutrum.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'{\"titleRaw\":[],\"descriptionRaw\":\"\",\"keywords\":[],\"score\":\"neutral\",\"social\":{\"twitter\":{\"handle\":null,\"title\":\"Interactive 3D Brain Data Browse - MetaCell\",\"image\":null,\"description\":\"\"},\"facebook\":{