,'2019-02-13 08:40:14','8c42bcc0-9f08-4da2-9124-cfbc0513be7a',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(58,100,1,'Open Source Brain','2019-02-13 08:47:03','2019-02-13 08:47:03','e1dc7bb4-c2ba-448d-9607-1cb4240e3750',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(59,101,1,'NEURON UI','2019-02-14 22:26:27','2019-02-27 04:41:02','85175c15-e075-4740-9f64-9ae198478e82','<p><a href=\"https://www.neuron.yale.edu/neuron/\">NEURON</a> is a widely used simulator in the neural multi-scale modelling domain, allowing models to be built that link reaction–diffusion dynamics at the molecular level, to neuronal electrophysiology, up to the large-scale network. MetaCell prototyped a <a href=\"https://github.com/metacell/neuron-ui\">new user interface</a> for NEURON using Geppetto.</p>',NULL,NULL,NULL,'https://www.youtube.com/watch?v=XkbauvReJFA',NULL,NULL,NULL,NULL,'{\"titleRaw\":[],\"descriptionRaw\":\"\",\"keywords\":[],\"score\":\"neutral\",\"social\":{\"twitter\":{\"handle\":null,\"title\":\"NEURON UI - MetaCell\",\"image\":null,\"description\":\"\"},\"facebook\":{\"handle\":null,\"title\":\"NEURON UI - MetaCell\",\"image\":null,\"description\":\"\"}},\"advanced\":{\"robots\":[],\"canonical\":null}}'),(60,102,1,'Patient H.M.','2019-02-14 22:27:02','2019-02-27 04:41:02','198ae3f2-9530-480e-9b46-df0ab2bc7f9d','<p>Henry G. Molaison, <a href=\"http://patienthm.org\">Patient H.M.</a>, represents one of the most important cases in the history of neuropsychology. MetaCell worked with Dr. Jacopo Annese, Director at The Brain Observatory, to build a web application for the display of high value image data collected from the famous neuroscience patient.</p>',NULL,NULL,NULL,'https://www.youtube.com/watch?v=XkbauvReJFA',NULL,NULL,NULL,NULL,'{\"titleRaw\":[],\"descriptionRaw\":\"\",\"keywords\":[],\"score\":\"neutral\",\"social\":{\"twitter\":{\"handle\":null,\"title\":\"Patient H.M. - MetaCell\",\"image\":null,\"description\":\"\"},\"facebook\":{\"handle\":null,\"title\":\"Patient H.M. - MetaCell\",\"image\":null,\"description\":\"\"}},\"advanced\":{\"robots\":[],\"canonical\":null}}'),(61,103,1,'Open Source Brain Case Study','2019-02-14 22:28:53','2019-02-27 04:41:01','c0e7bb60-cf34-46e2-9530-77d81a72c9dd','<p><a href=\"http://www.opensourcebrain.org/\" target=\"_blank\" rel=\"noreferrer noopener\">Open Source Brain</a> is a project of <strong>University College London</strong> - funded by the <strong>Wellcome Trust</strong> - to build a resource for sharing and collaboratively developing computational models of neural systems. Open Source Brain lets users explore and simulate computational models of neuronal networks and individual neurons.</p>\n<p>This <strong>case study</strong> gives an overview of the key features of Open Source Brain and outlines MetaCell\'s role in building the current version of the tool.</p>\n<p>For any questions on Open Source Brain, or to arrange a meeting with the MetaCell team, please email <a href=\"mailto:info@metacell.us\"><strong>info@metacell.us</strong></a> or call [US] +1 (347) 878 3679 or [UK] +44 (0)74 475 40306.</p>',NULL,NULL,NULL,'https://www.youtube.com/watch?v=XkbauvReJFA',NULL,NULL,NULL,NULL,'{\"titleRaw\":[],\"descriptionRaw\":\"\",\"keywords\":[],\"score\":\"neutral\",\"social\":{\"twitter\":{\"handle\":null,\"title\":\"Open Source Brain Case Study - MetaCell\",\"image\":null,\"description\":\"\"},\"facebook\":{\"handle\":null,\"title\":\"Open Source Brain Case Study - MetaCell\",\"image\":null,\"description\":\"\"}},\"advanced\":{\"robots\":[],\"canonical\":null}}'),(62,104,1,'Virtual Fly Brain 2.0 Case Study','2019-02-14 22:29:27','2019-02-27 04:41:02','e2b43970-45a2-4038-8d84-bf1aecb10b04','<p>Virtual Fly Brain is a joint effort of <strong>University of Edinburgh</strong>, <strong>LMB Cambridge</strong> and <strong>EBI</strong> - funded by the <strong>Wellcome Trust</strong> - to produce fly brain data-driven imaging, visualization and browsing. Using a 3D Brain Viewer, it is possible to explore the fruit fly anatomy and view image stacks from datasets integrated by Virtual Fly Brain.<br /></p>\n<p>\n</p>\n<p>This <strong>in-depth, beautifully designed case study</strong> explains Virtual Fly Brain key features, what you can do with them, MetaCell\'s strategic role building the new version of VFB and its results. It\'s also packed with great visuals.</p>\n<p>For any questions on Virtual Fly Brain, or to arrange a meeting with the MetaCell team, please email <a href=\"mailto:info@metacell.us\"><strong>info@metacell.us</strong></a> or call [US] +1 (347) 878 3679 or [UK] +44 (0)74 475 40306.</p>',NULL,NULL,NULL,'https://www.youtube.com/watch?v=XkbauvReJFA',NULL,NULL,NULL,NULL,'{\"titleRaw\":[],\"descriptionRaw\":\"\",\"keywords\":[],\"score\":\"neutral\",\"social\":{\"twitter\":{\"handle\":null,\"title\":\"Virtual Fly Brain 2.0 Case Study - MetaCell\",\"image\":null,\"description\":\"\"},\"facebook\":{\"handle\":null,\"title\":\"Virtual Fly Brain 2.0 Case Study - MetaCell\",\"image\":null,\"description\":\"\"}},\"advanced\":{\"robots\":[],\"canonical\":null}}'),(63,105,1,'Pfizer Data Integration','2019-02-14 22:30:01','2019-02-27 04:41:02','02b83f78-bdfc-48b3-994b-057a6828c49f','<p><a href=\"https://www.pfizer.com/\">Pfizer</a> is investing in the creation of digital biomarkers, or signatures of disease states that can be detected from digital devices, to assist in the drug discovery R&amp;D process. MetaCell is building a system to transfer data collected from human subjects with wearable devices and other sensors into a database.</p>',NULL,NULL,NULL,'https://www.youtube.com/watch?v=XkbauvReJFA',NULL,NULL,NULL,NULL,'{\"titleRaw\":[],\"descriptionRaw\":\"\",\"keywords\":[],\"score\":\"neutral\",\"social\":{\"twitter\":{\"handle\":null,\"title\":\"Pfizer Data Integration - MetaCell\",\"image\":null,\"description\":\"\"},\"facebook\":{\"handle\":null,\"title\":\"Pfizer Data Integration - MetaCell\",\"image\":null,\"description\":\"\"}},\"advanced\":{\"