rocess. MetaCell is building a system to transfer data collected from human subjects with wearable devices and other sensors into a database.</p>',NULL,NULL,'{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download Case Study \",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"105\"}',NULL,NULL,NULL,NULL,NULL,'{\"titleRaw\":[],\"descriptionRaw\":\"\",\"keywords\":[],\"score\":\"neutral\",\"social\":{\"twitter\":{\"handle\":null,\"title\":\"Pfizer Data Integration - MetaCell\",\"image\":null,\"description\":\"\"},\"facebook\":{\"handle\":null,\"title\":\"Pfizer Data Integration - MetaCell\",\"image\":null,\"description\":\"\"}},\"advanced\":{\"robots\":[],\"canonical\":null}}'),(92,196,1,'NEIRONUI','2019-02-19 05:52:03','2019-02-19 05:52:03','a2162c90-8ea1-4c14-8a9e-f698b697d1fb',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(93,197,1,'NEURON UI','2019-02-19 05:52:28','2019-02-27 04:46:04','0e981f06-6f24-465b-8b6e-a716ab56c27e','<p><a href=\"https://www.neuron.yale.edu/neuron/\">NEURON</a> is a widely used simulator in the neural multi-scale modelling domain, allowing models to be built that link reaction–diffusion dynamics at the molecular level, to neuronal electrophysiology, up to the large-scale network. MetaCell prototyped a <a href=\"https://github.com/metacell/neuron-ui\">new user interface</a> for NEURON using Geppetto.</p>',NULL,NULL,'{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download Case Study \",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"101\"}',NULL,NULL,NULL,NULL,NULL,'{\"titleRaw\":[],\"descriptionRaw\":\"\",\"keywords\":[],\"score\":\"neutral\",\"social\":{\"twitter\":{\"handle\":null,\"title\":\"NEURON UI - MetaCell\",\"image\":null,\"description\":\"\"},\"facebook\":{\"handle\":null,\"title\":\"NEURON UI - MetaCell\",\"image\":null,\"description\":\"\"}},\"advanced\":{\"robots\":[],\"canonical\":null}}'),(94,198,1,'NetPyNE UI','2019-02-19 06:02:26','2019-02-27 04:41:02','fc4ef558-60c7-4d7b-a261-54f9912d2279','<p><a href=\"http://netpyne.org/\">NetPyNE</a> is a python package to facilitate the development, parallel simulation and analysis of biological neuronal networks using the NEURON simulator. MetaCell significantly advanced the development of the <a href=\"https://github.com/MetaCell/NetPyNE-UI\">user interface of NetPyNE</a>, and recently released version 0.5.</p>',NULL,NULL,NULL,'https://www.youtube.com/watch?v=XkbauvReJFA',NULL,NULL,NULL,NULL,'{\"titleRaw\":[],\"descriptionRaw\":\"\",\"keywords\":[],\"score\":\"neutral\",\"social\":{\"twitter\":{\"handle\":null,\"title\":\"NetPyNE UI - MetaCell\",\"image\":null,\"description\":\"\"},\"facebook\":{\"handle\":null,\"title\":\"NetPyNE UI - MetaCell\",\"image\":null,\"description\":\"\"}},\"advanced\":{\"robots\":[],\"canonical\":null}}'),(95,199,1,'The brain that change everything','2019-02-19 06:10:07','2019-02-27 04:41:35','4e9c130d-01b0-42eb-b00c-add4c498b9e9','<p>Pellentesque volutpat sed leo id posuere. Ut pulvinar diam eu elit consequat, non bibendum quam porttitor. Vivamus ullamcorper viverra nisi. Cras auctor magna risus, sed rhoncus velit venenatis vitae. Quisque venenatis enim in ligula rutrum, non consequat nunc rutrum. Nunc ultricies nunc nec congue congue. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Fusce eleifend ligula purus, sit amet facilisis massa imperdiet id. Morbi suscipit suscipit nisl, ac vestibulum ex auctor in. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla malesuada, urna sed porta blandit, erat dolor tincidunt risus, a accumsan erat nisi quis purus. Aenean id interdum ex. Vestibulum sodales consectetur ante, nec tristique lacus dapibus at. Phasellus suscipit ac dui id cursus. Aliquam lacinia pulvinar varius. Curabitur vitae pretium urna.</p><figure></figure>\n<figure></figure>\n<figure></figure>\n<figure></figure>\n<p>In summary, we have explored what it takes to create value from data in the 21st century in the area of neuroscience. We have seen that visualization is a powerful way to deal with multi-modal data, which is becoming the keystone of modern neuroscience R&amp;D. Furthermore, the creation of cross-disciplinary teams to evaluate and work with that data requires building collaborations that are enabled by powerful and context-heavy user interfaces. Lastly, we’ve seen that, in order to create such applications, key skill sets must converge: neuroscience experience, full-stack software engineering, and process control. </p>\n<p>Organizations that learn these lessons of neuroscience data will end up with powerful, enabling software</p>\n<p>technologies that will lead to the creation of high-value research.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'{\"titleRaw\":[],\"descriptionRaw\":\"\",\"keywords\":[],\"score\":\"neutral\",\"social\":{\"twitter\":{\"handle\":null,\"title\":\"The brain that change everything - MetaCell\",\"image\":null,\"description\":\"\"},\"facebook\":{\"handle\":null,\"title\":\"The brain that change everything - MetaCell\",\"image\":null,\"description\":\"\"}},\"advanced\":{\"robots\":[],\"canonical\":null}}'),(96,200,1,'Image4','2019-02-19 06:49:11','2019-02-19 06:49:11','46244ee2-7a04-4ef1-8266-17951b525be9',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(97,201,1,'Img3','2019-02-19 06:51:22','2019-02-19 06:51:22','8bd8226d-a329-4766-a3cb-2981175077f9',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(98,202,1,'Img3','2019-02-19 06:52:28','2019-02-19 06:52:28','391d823c-4475-4088-a3f7-43b69632a45f',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(99,203,1,'World-map','2019-02-19 06:53:40','2019-02-19 08:35:39','3750e3e7-1e4d-45bb-9671-9e4f17181198',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(100,205,1,'Whatisincluded','2019-02-19 06:59:21','2019-02-19 06:59:21','4b35f235-317f-41f8-bcb3-e76ed3f934f5',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(101,206,1,'World-map','2019-02-19 08:35:34','2019-02-19 08:35:34'