egrates data from published literature and image datasets making it possible to run cross searches, find similar neurons and compare image data on a <a href=\\\"http://www.metacell.us/VFBCaseStudy.html\\\">3D Viewer</a>.</p>\"}}','2019-02-09 20:52:25','2019-02-09 20:52:25','e1f06124-aaf3-4561-8d10-a5d89316c4e1'),(37,25,2,1,1,1,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"NetPyNE UI\",\"slug\":\"netpyne-ui\",\"postDate\":1549745520,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p><a href=\\\"http://netpyne.org/\\\">NetPyNE</a> is a python package to facilitate the development, parallel simulation and analysis of biological neuronal networks using the NEURON simulator. MetaCell significantly advanced the development of the <a href=\\\"https://github.com/MetaCell/NetPyNE-UI\\\">user interface of NetPyNE</a>, and recently released version 0.5.</p>\"}}','2019-02-09 20:52:51','2019-02-09 20:52:51','1424ec66-0589-4ad5-984d-c8fa8a6bb62e'),(38,2,1,1,1,35,'','{\"typeId\":\"1\",\"authorId\":null,\"title\":\"Homepage\",\"slug\":\"homepage\",\"postDate\":1549488600,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"1\":{\"3\":{\"type\":\"leadImage\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"headingColor1\":\"World leaders \\nin\",\"headingColor2\":\"software\\nfor neuroscience\",\"description\":\"MetaCell is a software company that puts \\nneuroscience data online, creating compelling visual\\nand collaborative experiences.\",\"button\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Request a quote\",\"target\":null,\"title\":null,\"type\":\"custom\",\"value\":\"#\"},\"image\":[\"4\"],\"bottomLinks\":{\"8\":{\"type\":\"1\",\"fields\":{\"image\":[\"5\"],\"linkTo\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Data Exploration Software\",\"target\":null,\"title\":null,\"type\":\"custom\",\"value\":\"#\"}}},\"9\":{\"type\":\"1\",\"fields\":{\"image\":[\"6\"],\"linkTo\":{\"ariaLabel\":null,