.twig\"}},\"47\":{\"type\":\"team\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"template\":\"default.twig\"}}}}}','2019-02-10 17:59:00','2019-02-10 17:59:00','2d69d61b-25af-4db1-ae0c-dea64396d463'),(67,50,4,1,1,1,'','{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Stephen Larson\",\"slug\":\"stephen-larson\",\"postDate\":1549823580,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p>Stephen Larson, co-founder and CEO of MetaCell, is an expert on the intersection between computer technology and biological systems, and is interested in how computer systems can help us understand fundamental principles of life. Stephen serves as the Project Director for the OpenWorm Foundation. He served as the Chief Information Officer of One Mind for Research, a non-profit dedicated to eradicating brain disease by transforming the healthcare research system through public-private partnerships. He has worked as a professional software engineer for a major New York City investment bank, co-developed a patent, presented at more than two dozen forums, published in academic journals such as Frontiers in Neuroscience and Nature, and has had his work featured in the New York Times, The Atlantic, Wired, and MSNBC.com. His diverse educational background includes a bachelor of science and master of engineering from MIT in computer science as well as a PhD in neuroscience from the University of California, San Diego.</p>\",\"47\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"email\",\"value\":\"\"},\"45\":[\"49\"],\"46\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"url\",\"value\":\"https://www.linkedin.com/in/stephendavidlarson/\"}}}','2019-02-10 18:33:49','2019-02-10 18:33:49','b7d74cf0-2449-4eaa-8d73-b415cb566f22'),(68,52,4,1,1,1,'','{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Giovanni Idili\",\"slug\":\"giovanni-idili\",\"postDate\":1549823760,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p>Giovanni Idili. co-founder and COO of MetaCell, is an engineer and entrepreneur. Before founding MetaCell with Stephen and Matteo, Giovanni has worked as a software consultant for companies such as Rockwell Automation, Snap-on Diagnostics and 8 West Consulting. His professional experience focuses on getting projects off the ground and leading analysis and development of large scale software solutions, working with sizable teams. Throughout the years Giovanni co-founded two startups and a not for profit. Giovanni earned a Bachelor degree in Electronic Engineering at Università di Cagliari, Italy, in 2005, and a Master degree in Computer Science from Cork Institute of Technology, Ireland, in 2010. Within MetaCell Giovanni has evolved into a senior operations centric management role, overseeing the internals of the company as a whole, as well as running and staffing projects as needed.</p>\",\"47\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"email\",\"value\":\"\"},\"45\":[\"51\"],\"46\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"url\",\"value\":\"https://www.linkedin.com/in/giovanniidili/\"}}}','2019-02-10 18:36:36','2019-02-10 18:36:36','37424b27-9652-4779-a44e-9be3fc4452e1'),(69,54,4,1,1,1,'','{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Matteo Cantarelli\",\"slug\":\"matteo-cantarelli\",\"postDate\":1549823820,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p>Matteo Cantarelli, Founder and CTO of MetaCell, is a software architect and entrepreneur. In 2012 Matteo worked as Principal Research Associate with the Department of Neuroscience, Physiology and Pharmacology at the University College of London to build Open Source Brain, a resource to develop and share computational models of neurons. In 2011 he co-founded the OpenWorm Foundation which he now serves as Financial Director. Matteo published with the Royal Society of London, is inventor in an Interactive-Visual patent, and had his work featured on The Economist. In his early career Matteo worked as Senior Engineer for Pilz Ireland, leader in the industrial automation market. Matteo holds a master in systems Engineering from the École Normale Supérieure de Paris-Saclay (France) as well as a master and bachelor degree in electronic engineering from the University of Cagliari (Italy).</p>\",\"47\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"email\",\"value\":\"\"},\"45\":[\"53\"],\"46\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"url\",\"value\":\"https://www.linkedin.com/in/matteocantarelli/\"}}}','2019-02-10 18:37:59','2019-02-10 18:37:59','f7487596-0116-470c-9e83-aa36607391df'),(70,2,1,1,1,40,'','{\"typeId\":\"1\",\"authorId\":null,\"title\":\"Homepage\",\"slug\":\"homepage\",\"postDate\":1549488600,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"1\":{\"3\":{\"type\":\"leadImage\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"headingColor1\":\"World leaders \\nin\",\"headingColor2\":\"software\\nfor neuroscience\",\"description\":\"MetaCell is a software company that puts \\nneuroscience data online, creating compelling visual\\nand collaborative experiences.\",\"button\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Request a quote\",\"target\":null,\"title\":null,\"type\":\"custom\",\"value\":\"#\"},\"image\":[\"4\"],\"bottomLinks\":{\"8\":{\"type\":\"1\",\"fields\":{\"image\":[\"5\"],\"linkTo\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Data Exploration Software\",\"target\":null,\"title\":null,\"type\":\"custom\",\"value\":\"#\"}}},\"9\":{\"type\":\"1\",\"fields\":{\"image\":[\"6\"],\"linkTo\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Comput