ical neuronal networks using the NEURON simulator. MetaCell significantly advanced the development of the <a href=\\\"https://github.com/MetaCell/NetPyNE-UI\\\">user interface of NetPyNE</a>, and recently released version 0.5.</p>\",\"34\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download Case Study\",\"target\":null,\"title\":null,\"type\":\"asset\",\"value\":\"27\"},\"39\":[\"38\"],\"37\":[\"89\"]}}','2019-02-12 17:32:10','2019-02-12 17:32:10','abfcb103-c3bc-4826-a47a-fccc2a9153dd'),(102,23,2,1,1,7,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Open Source Brain\",\"slug\":\"open-source-brain\",\"postDate\":1549745460,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p><a href=\\\"http://www.opensourcebrain.org/\\\">Open Source Brain</a> is an initiative by the Silver Lab at University College London to encourage collaborative development of models in computational neuroscience. MetaCell has worked with Open Source Brain to integrate <a href=\\\"http://www.geppetto.org/\\\">Geppetto</a> - an open source simulation platform - and enable neuroscientists to explore and run simulations of the latest computational models of neurons and networks developed in the scientific community.</p>\",\"34\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download Case Study\",\"target\":null,\"title\":null,\"type\":\"asset\",\"value\":\"26\"},\"39\":[\"39\",\"37\",\"36\"],\"37\":[\"88\"]}}','2019-02-12 17:32:23','2019-02-12 17:32:23','d7444e09-367e-48b8-8435-3c2ed20dc94e'),(103,25,2,1,1,7,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"NetPyNE UI\",\"slug\":\"netpyne-ui\",\"postDate\":1549745520,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p><a href=\\\"http://netpyne.org/\\\">NetPyNE</a> is a python package to facilitate the development, parallel simulation and analysis of biological neuronal networks using the NEURON simulator. MetaCell significantly advanced the development of