ta from published literature and image datasets making it possible to run cross searches, find similar neurons and compare image data on a <a href=\\\"http://www.metacell.us/VFBCaseStudy.html\\\">3D Viewer</a>.</p>\",\"69\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download Case Study\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"104\"},\"39\":[],\"37\":[\"98\"]}}','2019-02-14 22:31:08','2019-02-14 22:31:08','039b5154-0af8-4de4-85b4-009678d8271a'),(115,25,2,1,1,8,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"NetPyNE UI\",\"slug\":\"netpyne-ui\",\"postDate\":1549745520,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p><a href=\\\"http://netpyne.org/\\\">NetPyNE</a> is a python package to facilitate the development, parallel simulation and analysis of biological neuronal networks using the NEURON simulator. MetaCell significantly advanced the development of the <a href=\\\"https://github.com/MetaCell/NetPyNE-UI\\\">user interface of NetPyNE</a>, and recently released version 0.5.</p>\",\"69\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download Case Study\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"102\"},\"39\":[\"38\"],\"37\":[\"99\"]}}','2019-02-14 22:31:42','2019-02-14 22:31:42','2f3aabe2-804e-4549-978e-787546bc0a48'),(116,23,2,1,1,9,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Open Source Brain\",\"slug\":\"open-source-brain\",\"postDate\":1549745460,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p><a href=\\\"http://www.opensourcebrain.org/\\\">Open Source Brain</a> is an initiative by the Silver Lab at University College London to encourage collaborative development of models in computational neuroscience. MetaCell has worked with Open Source Brain to integrate <a href=\\\"http://www.geppetto.org/\\\">Geppetto</a> - an open source simulation platform - and enable neuroscientists to explore and run simulations of the latest computational models of neurons and networks developed in the scientific community.</p>\",\"69\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download white paper\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"103\"},\"39\":[\"39\",\"37\",\"36\"],\"37\":[\"100\"]}}','2019-02-14 22:32:13','2019-02-14 22:32:13','841ac0be-6c97-4504-9006-169e95ddfbc1'),(117,2,1,1,1,59,'','{\"typeId\":\"1\",\"authorId\":null,\"title\":\"Homepage\",\"slug\":\"homepage\",\"postDate\":1549488600,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"1\":{\"3\":{\"type\":\"leadImage\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"headingColor1\":\"World leaders \\nin\",\"headingColor2\":\"software\\nfor neuroscience\",\"description\":\"MetaCell is a software company that puts \\nneuroscience data online, creating compelling visual\\nand collaborative experiences.\",\"button\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Request a quote\",\"target\":null,\"title\":null,\"type\":\"custom\",\"value\":\"#\"},\"video\":[\"88\"],\"bottomLinks\":{\"8\":{\"type\":\"1\",\"fields\":{\"image\":[\"5\"],\"linkTo\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Data Exploration Software\",\"target\":null,\"title\":null,\"type\":\"custom\",\"value\":\"#\"}}},\"9\":{\"type\":\"1\",\"fields\":{\"image\":[\"6\"],\"linkTo\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Computational Software\",\"target\":null,\"title\":null,\"type\":\"custom\",\"value\":\"#\"}}},\"10\":{\"type\":\"1\",\"fields\":{\"image\":[\"7\"],\"linkTo\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Strategic Consulting\",\"target\":null,\"title\":null,\"type\":\"custom\",\"value\":\"#\"}}}},\"template\":\"E:\\\\Code\\\\Craft\\\\metacell\\\\templates\\\\_components\\\\leadImage\\\\default.twig\"}},\"59\":{\"type\":\"logoSlider\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"PARTNERS\",\"items\":{\"60\":{\"type\":\"4\