drug development for neurological diseases and run virtual clinical trials.\",\"template\":\"default.twig\"}},\"118\":{\"type\":\"text\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"text\":\"<p>It will provide Pharma companies a computational environment for answering advanced questions about human neurology by harnessing the underlying shared anatomy of disparate human neuroscience datasets.</p>\",\"template\":\"fullWidth.twig\"}},\"119\":{\"type\":\"image\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"image\":[\"14\"],\"template\":\"default.twig\"}},\"120\":{\"type\":\"text\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"text\":\"<p>By creating a centralized model of experimental and clinical knowledge, hypotheses may be tested and prospective interventions may be simulated in the system itself, playing a critical supporting role in identifying appropriate targets for investment.</p>\",\"template\":\"shiftedCentered.twig\"}},\"121\":{\"type\":\"callToAction\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Let’s make something great together.\",\"description\":\"Let us know what challenges you are trying to solve so we can help.\",\"button\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Get in touch\",\"target\":null,\"title\":null,\"type\":\"custom\",\"value\":\"#\"},\"template\":\"defaulr.twig\"}}}}}','2019-02-16 08:44:30','2019-02-16 08:44:30','709bc4b4-4b09-4d4a-b04f-cb5b4a2d18e6'),(128,122,10,1,1,1,'','{\"typeId\":\"14\",\"authorId\":\"1\",\"title\":\"Our Portfolio\",\"slug\":\"our-portfolio\",\"postDate\":1550308380,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"1\":[]}}','2019-02-16 09:13:51','2019-02-16 09:13:51','ea18ef88-59ce-4529-a94d-4baeeb5ede0f'),(129,123,10,1,1,1,'','{\"typeId\":\"14\",\"authorId\":\"1\",\"title\":\"Our Services\",\"slug\":\"our-services\",\"postDate\":1550308440,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"1\":[]}}','2019-02-16 09:14:18','2019-02-16 09:14:18','5faaf897-fc1e-43c6-aa9b-6f7aa910e861'),(130,124,10,1,1,1,'','{\"typeId\":\"14\",\"authorId\":\"1\",\"title\":\"Resources\",\"slug\":\"resources\",\"postDate\":1550308560,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"1\":[]}}','2019-02-16 09:16:13','2019-02-16 09:16:13','4d29fba3-3149-4841-a375-38b78141ff7e'),(131,125,10,1,1,1,'','{\"typeId\":\"14\",\"authorId\":\"1\",\"title\":\"Join Us\",\"slug\":\"join-us\",\"postDate\":1550308560,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"1\":[]}}','2019-02-16 09:16:28','2019-02-16 09:16:28','4df78ef8-3ca0-43fb-a249-96c0118a6c01'),(132,126,10,1,1,1,'','{\"typeId\":\"14\",\"authorId\":\"1\",\"title\":\"Contact Us\",\"slug\":\"contact-us\",\"postDate\":1550308560,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"1\":[]}}','2019-02-16 09:16:42','2019-02-16 09:16:42','accd8d8d-72ed-44b7-90ab-a20b00f08587'),(133,127,10,1,1,1,'','{\"typeId\":\"14\",\"authorId\":\"1\",\"title\":\"Request a quote\",\"slug\":\"request-a-quote\",\"postDate\":1550308560,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"1\":[]}}','2019-02-16 09:16:55','2019-02-16 09:16:55','9d9af855-22fc-44fb-9ca1-ccc19f456366'),(134,54,4,1,1,4,'','{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Matteo Cantarelli\",\"slug\":\"matteo-cantarelli\",\"postDate\":1549823820,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p>Matteo Cantarelli, Founder and CTO of MetaCell, is a software architect and entrepreneur. In 2012 Matteo worked as Principal Research Associate with the Department of Neuroscience, Physiology and Pharmacology at the University College of London to build Open Source Brain, a resource to develop and share computational models of neurons. In 2011 he co-founded the OpenWorm Foundation which he now serves as Financial Director. Matteo published with the Royal Society of London, is inventor in an Interactive-Visual patent, and had his work featured on The Economist. In his early career Matteo worked as Senior Engineer for Pilz Ireland, leader in the industrial automation market. Matteo holds a master in systems Engineering from the École Normale Supérieure de Paris-Saclay (France) as well as a master and bachelor degree in electronic engineering from the University of Cagliari (Italy).</p>\",\"47\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"email\",\"value\":\"matteo@metacell.us\"},\"45\":[\"53\"],\"46\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"url\",\"value\":\"https://www.linkedin.com/in/matteocantarelli/\"}}}','2019-02-16 09:29:19','2019-02-16 09:29:19','1d816cf7-810c-4ddd-847a-d1de9fa4323c'),(135,52,4,1,1,2,'','{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Giovanni Idili\",\"slug\":\"giovanni-idili\",\"postDate\":1549823760,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p>Giovanni Idili. co-founder and COO of MetaCell, is an engineer and entrepreneur. Before founding MetaCell with Stephen and Matteo, Giovanni has worked as a software consultant for companies such as Rockwell Automation, Snap-on Diagnostics and 8 West Consulting. His professional experience focuses on getting projects off the ground and leading analysis and development of large scale software solutions, working with sizable teams. Throughout the years Giovanni co-founded two startups and a not for profit. Giovanni earned a Bachelor degree in Electronic Engineering at Università di Cagliari, Italy, in 2005, and a Master degree in Computer Science from Cork Institute of Technology, Ireland, in 2010. Within MetaCell Giovanni has evolved into a senior operations centric management role, overseeing the internals of the company as a whole, as well as running and staffing projects as needed.</p>\",\"47\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"email\",\"value\":\"giovanni@metacell.us\"},\"45\":[\"51\"],\"46\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"url\",\"value\":\"https://www.linkedin.com/in/giovanniidili/\"}}}','2019-02-16 09:29:40','2019-02-16 09:29:40','f05e804e-bc55-4488-80fb-c7e5cb2be56d'),(136,50,4,1,1,2,'','{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Stephen Larson\",\"slug\":\"stephen-larson\",\"postDate\":1549823580,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p>Stephen Larson, co-founder and CEO of MetaCell, is an expert on the intersection between computer technology and biological systems, and is interested in how computer systems can help us understand fundamental principles of life. Stephen serves as the Project Director for the OpenWorm Foundation. He served as the Chief Information Officer of One Mind for Research, a non-profit dedicated to eradicating brain disease by transforming the healthcare research system through public-private partnerships. He has worked as a professional software engineer for a major New York City investment bank, co-developed a patent, presented at more than two dozen forums, published in academic journals such as Frontiers in Neuroscience and Nature, and has had his work featured in the New York Times, The Atlantic, Wired, and MSNBC.com. His diverse educational background includes a bachelor of science and master of engineering from MIT in computer science as well as a PhD in neuroscience from the University of California, San Diego.</p>\",\"47\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"email\",\"value\":\"stephen@metacell.us\"},\"45\":[\"49\"],\"46\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"url\",\"value\":\"https://www.linkedin.com/in/stephendavidlarson/\"}}}','2019-02-16 09:29:58','201