ining - you are guaranteed we will speak the same language from the get go.<br /></p>\",\"secondCol\":\"<h6 class=\\\"title\\\">Our Neuroscience Data Exploration Software package includes:</h6>\\n<ul>\\n <li>Requirements gathering</li>\\n <li>Project management (including integration with in-house teams as needed)</li>\\n <li>Graphics, User Interface, and User Experience design<ul>\\n <li>Protocol integration</li>\\n <li>Workflow management</li>\\n <li>Data storage</li>\\n <li>Data synchronization</li>\\n <li>Data access and visualization</li>\\n <li>Programmatic API access</li></ul></li></ul><ul><li>Automated unit and integration testing</li><li>Production deployment</li></ul>\",\"template\":\"default.twig\"}},\"161\":{\"type\":\"text2Cols\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"firstCol\":\"<h1>Features</h1>\\n<p>With our unique understanding of drug pre-clinical and clinical trials, neuroscience, software engineering and regulation compliance, we require no training - you are guaranteed we will speak the same language from the get go.</p>\",\"secondCol\":\"<h6 class=\\\"title\\\">Our Neuroscience Data Exploration Software package includes:</h6>\\n<ul><li>Protocol integration</li><li>Workflow management</li><li>Data storage</li><li>Data synchronization</li><li>Data access and visualization</li><li>Programmatic API access</li><li>Automated unit and integration testing</li><li>Production deployment</li></ul>\",\"template\":\"default.twig\"}},\"162\":{\"type\":\"text2Cols\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"firstCol\":\"<h6 class=\\\"title\\\">Building your scientific software platform</h6>\\n<p>Is your organization facing barriers to your development work with critical neuroscience data?</p>\\n<h6 class=\\\"title\\\">Data integration</h6>\\n<p>Aligning, integrating, and delivering knowledge within and outside your organization can be a tremendous challenge. Our in-house expertise will enable you to cut through to the core of the challen