itecture design</li><li>High-quality, industry-standard custom-built software application for:<ul><li><ul><li>Data storage and synchronization</li><li>Data access and visualization</li></ul></li></ul></li></ul>\\n<ul><li>Automated unit and integration testing</li><li>Production deployment</li></ul>\\n\",\"template\":\"default.twig\"}},\"178\":{\"type\":\"text\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"text\":\"<p>Data in neuroscience is generated at a tremendous rate. Knowing how to use it to produce the solutions you need requires crossover expertise from both computer engineering and biology. We make this possible for your organization.</p>\",\"template\":\"shiftedCentered.twig\"}},\"162\":{\"type\":\"text2Cols\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"firstCol\":\"<h6 class=\\\"title\\\">Building your scientific software platform<br /></h6>\\n<p>Is your organization facing barriers to your development work with critical neuroscience data?</p>\\n<h6 class=\\\"title\\\">Data integration</h6>\\n<p>Aligning, integrating, and delivering knowledge within and outside your organization can be a tremendous challenge. Our in-house expertise will enable you to cut through to the core of the challenge to provide robust and dependable solutions.<br /><br /></p>\",\"secondCol\":\"<h6 class=\\\"title\\\">Translational computational biology</h6>\\n<p>Get delivery of solidly engineered software that translate sciences discoveries into tangible solutions.<br /></p>\",\"template\":\"alignTop.twig\"}},\"137\":{\"type\":\"callToAction\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Let’s make something great together.\",\"description\":\"Let us know what challenges you are trying to solve so we can help.\",\"button\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Get in touch\",\"target\":null,\"title\":null,\"type\":\"custom\",\"value\":\"#\"},\"template\":\"defaulr.twig\"}}}}}','2019-02-18 07:08:55','2019-02-18 07:08:55','d501a32b-d4