\"type\":\"text2Cols\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"firstCol\":\"<h1>Features</h1>\\r\\n<p>With our unique understanding of drug pre-clinical and clinical trials, neuroscience, software engineering and regulation compliance, we require no training - you are guaranteed we will speak the same language from the get go. We eliminate all of the complexities of building robust software, and produce user experiences that are as functional as they are visually compelling.</p>\",\"secondCol\":\"<h6 class=\\\"title\\\">Our Neuroscience Data Exploration Software package includes:</h6>\\r\\n<ul>\\r\\n <li>Requirements gathering</li>\\r\\n <li>Project management (including integration with in-house teams as needed)</li>\\r\\n <li>Graphics, User Interface, and User Experience design<ul>\\r\\n <li>Protocol integration</li>\\r\\n <li>Workflow management</li>\\r\\n <li>Data storage</li>\\r\\n <li>Data synchronization</li>\\r\\n <li>Data access and visualization</li>\\r\\n <li>Programmatic API access</li></ul></li></ul>\\r\\n<ul><li>Automated unit and integration testing</li><li>Production deployment</li></ul>\",\"template\":\"default.twig\"}},\"161\":{\"type\":\"text2Cols\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"firstCol\":\"<h1>Features</h1>\\r\\n<p>As a world-leading provider of custom web applications for neuroscience data visualization and sharing, we build your software for you, so you stop worrying about software engineering and focus on reaching your goals. </p>\",\"secondCol\":\"<h6 class=\\\"title\\\">Our Web Applications for Neuroscience Data Visualization and Sharing package includes:</h6>\\r\\n<ul><li>Requirements gathering</li><li>Project management </li><li>Graphics, User Interface, and User Experience design </li><li>Software architecture design</li><li>High-quality, industry-standard custom-built software application for:<ul><li>Data storage and synchronization</li><li>Data access and visualisation</li></ul></li></ul>\\r\\n<ul><li>Automated unit and integration testing</li><li>Production deployment</li></ul>\",\"template\":\"default.twig\"}},\"162\":{\"type\":\"text2Cols\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"firstCol\":\"<h6 class=\\\"title\\\">Building your scientific software platform<br /></h6>\\r\\n<p>Is your organization facing barriers to your development work with critical neuroscience data?</p>\\r\\n<h6 class=\\\"title\\\">Data integration</h6>\\r\\n<p>Aligning, integrating, and delivering knowledge within and outside your organization can be a tremendous challenge. Our in-house expertise will enable you to cut through to the core of the challenge to provide robust and dependable solutions.<br /><br /></p>\",\"secondCol\":\"<h6 class=\\\"title\\\">Translational computational biology</h6>\\r\\n<p>Get delivery of solidly engineered software that translate sciences discoveries into tangible solutions.<br /></p>\",\"template\":\"alignTop.twig\"}},\"137\":{\"type\":\"callToAction\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Let’s make something great together.\",\"description\":\"Let us know what challenges you are trying to solve so we can help.\",\"button\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Get in touch\",\"target\":null,\"title\":null,\"type\":\"custom\",\"value\":\"#\"},\"template\":\"defaulr.twig\"}}}}}','2019-02-18 22:09:12','2019-02-18 22:09:12','1b8f7b61-02f1-4454-8f1b-a743c4f183ac'),(198,115,10,1,1,20,'','{\"typeId\":\"14\",\"authorId\":\"1\",\"title\":\"Our Platform\",\"slug\":\"our-platform\",\"postDate\":1550306640,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"1\":{\"116\":{\"type\":\"pageTitle\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Our Platform\",\"description\":\"We have deconstructed the world’s most valuable human neuroscience datasets\",\"template\":\"default.twig\"}},\"118\":{\"type\":\"text\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"text\":\"<h1>Our software applications unlock the true value of neuroscience data and models, including microscopy and MRI images, EEG and electrophysiology data, computer simulations, and much more.</h1>\\r\\n<p>MetaCell’s neuroscience platform is a revolutionary system envisioned to accelerate drug development for neurological diseases and run virtual clinical trials. It will provide Pharma companies a computational environment for answering advanced questions about human neurology by harnessing the underlying shared anatomy of disparate human neuroscience datasets.</p>\",\"template\":\"fullWidth.twig\"}},\"119\":{\"type\":\"image\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"image\":[\"174\"],\"template\":\"default.twig\"}},\"120\":{\"type\":\"text\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"text\":\"<p>By creating a centralized model of experimental and clinical knowledge, hypotheses may be tested and prospective interventions may be simulated in the system itself, playing a critical supporting role in identifying appropriate targets for investment.</p>\",\"template\":\"shiftedCentered.twig\"}},\"155\":{\"type\":\"sectionTitle\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"What’s included in the platform?\",\"template\":\"default.twig\"}},\"150\":{\"type\":\"platformFeatures\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"items\":{\"152\":{\"type\":\"6\",\"fields\":{\"image\":[\"173\"],\"text\":\"<h4>Ask questions that nothing else today can answer</h4>\\r\\n<ul><li>Where are genes expressed in the brain?</li><li>What connectivity patterns overlap with genes in the brain?</li><li>How does a biomarker derived from datscan correlate to how much patients pick up their right leg during walking?</li><li>How does Alzheimers and Parkinsons affect brain volume during disease progression?</li><li>What genes are differentially involved in human neuroscience disease?</li><li>What patient population is likely to have more Tau than average given high cortisol levels in a blood test?</li><li>What levels of white matter tract integrity are necessary in the indirect pathway of the basal ganglia for working memory?</li></ul>\"}},\"153\":{\"type\":\"6\",\"fields\":{\"image\":[\"175\"],\"text\":\"<h4>The world’s most valuable human neuroscience datasets, integrated with a powerful query and analytics engine</h4>\\r\\n<ul><li>Allen Institute Human Brain Atlases</li><li>MNI Atlases</li><li>FSL Atlases</li><li>Interlex Knowledge Graph</li><li>ADNI</li><li>AIBL</li><li>PPMI</li><li>1000 functional connectomes</li><li>...and much more!</li></ul>\"}},\"154\":{\"type\":\"6\",\"fields\":{\"image\":[\"176\"],\"text\":\"<h4>Easily integrate your own datasets</h4>\\r\\n<ul><li>Opinionated and semantically constrained integration of data</li><li>Semantic augmentation pipeline to process your compatible datasets</li></ul>\"}}},\"template\":\"default.twig\"}},\"156\":{\"type\":\"sectionTitle\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Feature set\",\"template\":\"default.twig\"}},\"179\":{\"type\":\"featureSet\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"image\":[\"177\"],\"text\":\"<ul><li>A powerful graphical interface to intuitively explore the world’s best data and ask novel questions</li><li>Support for all DICOM-based human neuroscience images, including all varieties of MRI, PET, DATSCAN, etc.</li><li>A knowledge graph embodying our common reference space and all relationships between the world’s best data and your own datasets</li><li>A query engine to translate your questions into reasoning rules capable of gathering new facts from the data</li><li>An analytics engine to let you process the data further to gain additional insights</li><li>A simulation engine to generate new predictions based on computational models that describe your hypothesis</li><li>Collaboratively produce beautiful well-referenced reports from the queries, analyses, and simulations you conducted for sharing with colleagues</li><li>A backend that can scale with your data while keeping it safe and secure</li><li>A subscription that will give you access to the latest datasets as soon as they are ingested</li><li>API and Client tool access for programmatic discovery</li><li>Secure Cloud based deployment or on-site</li><li>Compliant with HIPAA, FISMA, GDPR for simplified FDA reporting</li></ul>\",\"expandable\":false,\"linkTo\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":null},\"template\":\"right.twig\"}},\"157\":{\"type\":\"sectionTitle\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"What’s included in the platform?\",\"template\":\"default.twig\"}},\"159\":{\"type\":\"featureSet\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"image\":[\"177\"],\"text\":\"<ul><li>A powerful graphical interface to intuitively explore the world’s best data and ask novel questions</li><li>Support for all DICOM-based human neuroscience images, including all varieties of MRI, PET, DATSCAN, etc.</li><li>A knowledge graph embodying our common reference space and all relationships between the world’s best data and your own datasets</li><li>A query engine to translate your questions into reasoning rules capable of gathering new facts from the data</li><li>An analytics engine to let you process the data further to gain additional insights</li><li>A simulation engine to generate new predictions based on computational models that describe your hypothesis</li><li>Collaboratively produce beautiful well-referenced reports from the queries, analyses, and simulations you conducted for sharing with colleagues</li><li>A backend that can scale with your data while keeping it safe and secure</li><li>A subscription that will give you access to the latest datasets as soon as they are ingested</li><li>API and Client tool access for programmatic discovery</li><li>Secure Cloud based deployment or on-site</li><li>Compliant with HIPAA, FISMA, GDPR for simplified FDA reporting</li></ul>\",\"expandable\":false,\"linkTo\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Discover\",\"target\":null,\"title\":null,\"type\":\"custom\",\"value\":\"#\"},\"template\":\"left.twig\"}},\"121\":{\"type\":\"callToAction\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Let’s make something great together.\",\"description\":\"Let us know what challenges you are trying to solve so we can help.\",\"button\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Get in touch\",\"target\":null,\"title\":null,\"type\":\"custom\",\"value\":\"#\"},\"template\":\"defaulr.twig\"}}}}}','2019-02-18 22:27:50','2019-02-18 22:27:50','c5f50def-aeaa-48db-8143-1206df63ce10'),(199,115,10,1,1,21,'','{\"typeId\":\"14\",\"authorId\":\"1\",\"title\":\"Our Platform\",\"slug\":\"our-platform\",\"postDate\":1550306640,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"1\":{\"116\":{\"type\":\"pageTitle\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Our Platform\",\"description\":\"We have deconstructed the world’s most valuable human neuroscience datasets\",\"template\":\"default.twig\"}},\"118\":{\"type\":\"text\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"text\":\"<h1>Our software applications unlock the true value of neuroscience data and models, including microscopy and MRI images, EEG and electrophysiology data, computer simulations, and much more.</h1>\\r\\n<p>MetaCell’s neuroscience platform is a revolutionary system envisioned to accelerate drug development for neurological diseases and run virtual clinical trials. It will provide Pharma companies a computational environment for answering advanced questions about human neurology by harnessing the underlying shared anatomy of disparate human neuroscience datasets.</p>\",\"template\":\"fullWidth.twig\"}},\"119\":{\"type\":\"image\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"image\":[\"174\"],\"template\":