:\"Data in neuroscience is generated at a tremendous rate. Knowing how to use it to produce the solutions you need requires crossover expertise from both computer engineering and biology.\",\"button\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Request a quote\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"127\"},\"video\":[\"99\"],\"template\":\"rightIcon.twig\"}},\"162\":{\"type\":\"text2Cols\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"firstCol\":\"<h6 class=\\\"title\\\">Building your scientific software platform<br /></h6>\\n<p>Is your organization facing barriers to your development work with critical neuroscience data?</p>\\n<h6 class=\\\"title\\\">Data integration</h6>\\n<p>Aligning, integrating, and delivering knowledge within and outside your organization can be a tremendous challenge. Our in-house expertise will enable you to cut through to the core of the challenge to provide robust and dependable solutions.<br /><br /></p>\",\"secondCol\":\"<h6 class=\\\"title\\\">Translational computational biology</h6>\\n<p>Get delivery of solidly engineered software that translate sciences discoveries into tangible solutions.<br /></p>\",\"template\":\"alignTop.twig\"}},\"137\":{\"type\":\"callToAction\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Let’s make something great together.\",\"description\":\"Let us know what challenges you are trying to solve so we can help.\",\"button\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Get in touch\",\"target\":null,\"title\":null,\"type\":\"custom\",\"value\":\"#\"},\"template\":\"defaulr.twig\"}}}}}','2019-02-19 05:18:21','2019-02-19 05:18:21','748b33f0-94f1-4992-b39a-8dc589b2d4a6'),(227,104,9,1,1,7,'','{\"typeId\":\"13\",\"authorId\":\"1\",\"title\":\"Virtual Fly Brain 2.0 Case Study\",\"slug\":\"case-study-3\",\"postDate\":1550183340,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p>Virtual Fly Brain is a joint effort of <strong>University of Edinburgh</strong>, <strong>LMB Cambridge</strong> and <strong>EBI</strong> - funded by the <strong>Wellcome Trust</strong> - to produce fly brain data-driven imaging, visualization and browsing. Using a 3D Brain Viewer, it is possible to explore the fruit fly anatomy and view image stacks from datasets integrated by Virtual Fly Brain.<br /></p><p>\\n</p><p>This <strong>in-depth, beautifully designed case study</strong> explains Virtual Fly Brain key features, what you can do with them, MetaCell\'s strategic role building the new version of VFB and its results. It\'s also packed with great visuals.</p>\\n<p>For any questions on Virtual Fly Brain, or to arrange a meeting with the MetaCell team, please email <a href=\\\"mailto:info@metacell.us\\\"><strong>info@metacell.us</strong></a> or call [US] +1 (347) 878 3679 or [UK] +44 (0)74 475 40306.</p><br />\\n\",\"34\":[\"27\"],\"1\":{\"181\":{\"type\":\"textSlider\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"slides\":{\"182\":{\"type\":\"7\",\"fields\":{\"text\":\"<p>\\\"It was great to work with MetaCell on expanding the Open Source Brain platform. They had an in-depth knowledge of the technologies involved, the scientific background and</p>\",\"author\":\"Dr. Padraig Gleeson, \\nSilver Lab, University College of London\"}},\"183\":{\"type\":\"7\",\"fields\":{\"text\":\"<p>\\\"It was great to work with MetaCell on expanding the Open Source Brain platform. They had an in-depth knowledge of the technologies involved, the scientific background and the project requirements. Their continuing contributions have made sure the platform is well designed, robust and provides an impressive user experience.\\\"</p>\",\"author\":\"Dr. Padraig Gleeson, \\nSilver Lab, University College of London\"}},\"184\":{\"type\":\"7\",\"fields\":{\"text\":\"<p>\\\"It was great to work with MetaCell on expanding the Open Source Brain platform. They had an in-depth knowledge of the technolplatform is well designed, robust and provides an impressive user experience.\\\"</p>\",\"author\":\"Dr. Padraig Gleeson, \\nSilver Lab, University College of London\"}}},\"template\":\"default.twig\"}}},\"81\":[\"166\"],\"90\":\"https://www.youtube.com/watch?v=XkbauvReJFA\"}}','2019-02-19 05:25:41','2019-02-19 05:25:41','cc82abde-2d4f-4a10-8e0e-c84dd91ff08b'),(228,104,9,1,1,8,'','{\"typeId\":\"13\",\"authorId\":\"1\",\"title\":\"Virtual Fly Brain 2.0 Case Study\",\"slug\":\"case-study-3\",\"postDate\":1550183340,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p>Virtual Fly Brain is a joint effort of <strong>University of Edinburgh</strong>, <strong>LMB Cambridge</strong> and <strong>EBI</strong> - funded by the <strong>Wellcome Trust</strong> - to produce fly brain data-driven imaging, visualization and browsing. Using a 3D Brain Viewer, it is possible to explore the fruit fly anatomy and view image stacks from datasets integrated by Virtual Fly Brain.<br /></p>\\n<p>\\n</p>\\n<p>This <strong>in-depth, beautifully designed case study</strong> explains Virtual Fly Brain key features, what you can do with them, MetaCell\'s strategic role building the new version of VFB and its results. It\'s also packed with great visuals.</p>\\n<p>For any questions on Virtual Fly Brain, or to arrange a meeting with the MetaCell team, please email <a href=\\\"mailto:info@metacell.us\\\"><strong>info@metacell.us</strong></a> or call [US] +1 (347) 878 3679 or [UK] +44 (0)74 475 40306.</p>\\n\",\"34\":[\"27\"],\"1\":{\"191\":{\"type\":\"sectionTitle\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Testimonials\",\"template\":\"default.twig\"}},\"181\":{\"type\":\"textSlider\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"slides\":{\"182\":{\"type\":\"7\",\"fields\":{\"text\":\"<p>\\\"It was great to work with MetaCell on expanding the Open Source Brain platform. They had an in-depth knowledge of the technologies involved, the scientific background and</p>\",\"author\":\"Dr. Padraig Gleeson, \\nSilver Lab, University College of London\"}},\"183\":{\"type\":\"7\",\"fields\":{\"text\":\"<p>\\\"It was great to work with MetaCell on expanding the Open Source Brain platform. They had an in-depth knowledge of the technologies involved, the scientific background and the project requirements. Their continuing contributions have made sure the platform is well designed, robust and provides an impressive user experience.\\\"</p>\",\"author\":\"Dr. Padraig Gleeson, \\nSilver Lab, University College of London\"}},\"184\":{\"type\":\"7\",\"fields\":{\"text\":\"<p>\\\"It was great to work with MetaCell on expanding the Open Source Brain platform. They had an in-depth knowledge of the technolplatform is well designed, robust and provides an impressive user experience.\\\"</p>\",\"author\":\"Dr. Padraig Gleeson, \\nSilver Lab, University College of London\"}}},\"template\":\"default.twig\"}}},\"81\":[\"166\"],\"90\":\"https://www.youtube.com/watch?v=XkbauvReJFA\"}}','2019-02-19 05:28:12','2019-02-19 05:28:12','8e0d94b9-0cd0-4d36-b39b-06ba1b80536a'),(229,103,9,1,1,3,'','{\"typeId\":\"12\",\"authorId\":\"1\",\"title\":\"Open Source Brain Case Study\",\"slug\":\"white-paper-1\",\"postDate\":1550183280,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p><a href=\\\"http://www.opensourcebrain.org/\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Open Source Brain</a> is a project of <strong>University College London</strong> - funded by the <strong>Wellcome Trust</strong> - to build a resource for sharing and collaboratively developing computational models of neural systems. Open Source Brain lets users explore and simulate computational models of neuronal networks and individual neurons.</p>\\n<p>This <strong>case study</strong> gives an overview of the key features of Open Source Brain and outlines MetaCell\'s role in building the current version of the tool.</p>\\n<p>For any questions on Open Source Brain, or to arrange a meeting with the MetaCell team, please email <a href=\\\"mailto:info@metacell.us\\\"><strong>info@metacell.us</strong></a> or call [US] +1 (347) 878 3679 or [UK] +44 (0)74 475 40306.</p>\",\"34\":[\"26\"],\"1\":[],\"81\":[\"164\"],\"90\":\"https://www.youtube.com/watch?v=XkbauvReJFA\"}}','2019-02-19 05:29:50','2019-02-19 05:29:50','c92386e4-1dec-49c6-a2fb-7a94f2ac5774'),(230,115,10,1,1,22,'','{\"typeId\":\"14\",\"authorId\":\"1\",\"title\":\"Our Platform\",\"slug\":\"our-platform\",\"postDate\":1550306640,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"1\":{\"116\":{\"type\":\"pageTitle\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Our Platform\",\"description\":\"We have deconstructed the world’s most valuable human neuroscience datasets\",\"template\":\"default.twig\"}},\"118\":{\"type\":\"text\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"text\":\"<h2>Our software applications unlock the true value of neuroscience data and models, including microscopy and MRI images, EEG and electrophysiology data, computer simulations, and much more.</h2>\\n<p>MetaCell’s neuroscience platform is a revolutionary system envisioned to accelerate drug development for neurological diseases and run virtual clinical trials. It will provide Pharma companies a computational environment for answering advanced questions about human neurology by harnessing the underlying shared anatomy of disparate human neuroscience datasets.</p>\",\"template\":\"fullWidth.twig\"}},\"119\":{\"type\":\"image\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"image\":[\"174\"],\"template\":\"default.twig\"}},\"120\":{\"type\":\"text\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"text\":\"<p>By creating a centralized model of experimental and clinical knowledge, hypotheses may be tested and prospective interventions may be simulated in the system itself, playing a critical supporting role in identifying appropriate targets for investment.</p>\",\"template\":\"shiftedCentered.twig\"}},\"155\":{\"type\":\"sectionTitle\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"What’s included in the platform?\",\"template\":\"default.twig\"}},\"150\":{\"type\":\"platformFeatures\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"items\":{\"152\":{\"type\":\"6\",\"fields\":{\"image\":[\"173\"],\"text\":\"<h4>Ask questions that nothing else today can answer</h4>\\n<ul><li>Where are genes expressed in the brain?</li><li>What connectivity patterns overlap with genes in the brain?</li><li>How does a biomarker derived from datscan correlate to how much patients pick up their right leg during walking?</li><li>How does Alzheimers and Parkinsons affect brain volume during disease progression?</li><li>What genes are differentially involved in human neuroscience disease?</li><li>What patient population is likely to have more Tau than average given high cortisol levels in a blood test?</li><li>What levels of white matter tract integrity are necessary in the indirect pathway of the basal ganglia for working memory?</li></ul>\"}},\"153\":{\"type\":\"6\",\"fields\":{\"image\":[\"175\"],\"text\":\"<h4>The world’s most valuable human neuroscience datasets, integrated with a powerful query and analytics engine</h4>\\n<ul><li>Allen Institute Human Brain Atlases</li><li>MNI Atlases</li><li>FSL Atlases</li><li>Interlex Knowledge Graph</li><li>ADNI</li><li>AIBL</li><li>PPMI</li><li>1000 functional connectomes</li><li>...and much more!</li></ul>\"}},\"154\":{\"type\":\"6\",\"fields\":{\"image\":[\"176\"],\"text\":\"<h4>Easily integrate your own datasets</h4>\\n<ul><li>Opinionated and semantically constrained integration of data</li><li>Semantic augmentation pipeline to process your compatible datasets</li></ul>\"}}},\"template\":\"default.twig\"}},\"156\":{\"type\":\"sectionTitle\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Feature set\",\"template\":\"default.twig\"}},\"179\":{\"type\":\"featureSet\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"image\":[\"177\"],\"text\":\"<ul><li>A powerful graphical interface to intuitively explore the world’s best data and ask novel questions</li><li>Support for all DICOM-based human neuroscience images, including all varieties of MRI, PET, DATSCAN, etc.</li><li>A knowledge graph embodying our common reference space and all relationships between the world’s best data and your own datasets</li><li>A query engine to translate your questions into reasoning rules capable of gathering new facts from the data</li><li>An analytics engine to let you process the data further to gain additional insights</li><li>A simulation engine to generate new predictions based on computational models that describe your hypothesis</li><li>Collaboratively produce beautiful well-referenced reports from the queries, analyses, and simulations you conducted for sharing with colleagues</li><li>A backend that can scale with your data while keeping it safe and secure</li><li>A subscription that will give you access to the latest datasets as soon as they are ingested</li><li>API and Client tool access for programmatic discovery</li><li>Secure Cloud based deployment or on-site</li><li>Compliant with HIPAA, FISMA, GDPR for simplified FDA reporting</li></ul>\",\"expandable\":true,\"linkTo\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":null},\"template\":\"right.twig\"}},\"157\":{\"type\":\"sectionTitle\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"What’s included in the platform?\",\"template\":\"default.twig\"}},\"159\":{\"type\":\"featureSet\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"image\":[\"177\"],\"text\":\"<ul><li>A powerful graphical interface to intuitively explore the world’s best data and ask novel questions</li><li>Support for all DICOM-based human neuroscience images, including all varieties of MRI, PET, DATSCAN, etc.</li><li>A knowledge graph embodying our common reference space and all relationships between the world’s best data and your own datasets</li><li>A query engine to translate your questions into reasoning rules capable of gathering new facts from the data</li><li>An analytics engine to let you process the data further to gain additional insights</li><li>A simulation engine to generate new predictions based on computational models that describe your hypothesis</li><li>Collaboratively produce beautiful well-referenced reports from the queries, analyses, and simulations you conducted for sharing with colleagues</li><li>A backend that can scale with your data while keeping it safe and secure</li><li>A subscription that will give you access to the latest datasets as soon as they are ingested</li><li>API and Client tool access for programmatic discovery</li><li>Secure Cloud based deployment or on-site</li><li>Compliant with HIPAA, FISMA, GDPR for simplified FDA reporting</li></ul>\",\"expandable\":false,\"linkTo\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Discover\",\"target\":null,\"title\":null,\"type\":\"custom\",\"value\":\"#\"},\"template\":\"left.twig\"}},\"121\":{\"type\":\"callToAction\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Let’s make something great together.\",\"description\":\"Let us know what challenges you are trying to solve so we can help.\",\"button\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Get in touch\",\"target\":null,\"title\":null,\"type\":\"custom\",\"value\":\"#\"},\"template\":\"defaulr.twig\"}}}}}','2019-02-19 05:30:11','2019-02-19 05:30:11','8ac0c95e-88ff-41f0-beb1-2ffc69ce8a60'),(231,106,10,1,1,12,'','{\"typeId\":\"14\",\"authorId\":\"1\",\"title\":\"Our Company\",\"slug\":\"our-company\",\"postDate\":1550304780,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"1\":{\"107\":{\"type\":\"pageTitle\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Our Company\",\"d