{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download white paper\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"102\"},\"39\":[],\"83\":[\"168\"],\"37\":[\"194\"]}}','2019-02-19 05:39:15','2019-02-19 05:39:15','a40a7fbf-e57b-4d7c-8be7-d7133889fa68'),(236,102,9,1,1,4,'','{\"typeId\":\"13\",\"authorId\":\"1\",\"title\":\"Patient H.M.\",\"slug\":\"case-study-2\",\"postDate\":1550183220,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p>Henry G. Molaison, <a href=\\\"http://patienthm.org\\\">Patient H.M.</a>, represents one of the most important cases in the history of neuropsychology. MetaCell worked with Dr. Jacopo Annese, Director at The Brain Observatory, to build a web application for the display of high value image data collected from the famous neuroscience patient.</p>\\n\",\"34\":[\"27\"],\"1\":[],\"81\":[\"166\"],\"90\":\"https://www.youtube.com/watch?v=XkbauvReJFA\"}}','2019-02-19 05:44:11','2019-02-19 05:44:11','06ebce8f-43b6-4f1a-88b2-a29a4d2f6f12'),(237,102,9,1,1,5,'','{\"typeId\":\"13\",\"authorId\":\"1\",\"title\":\"Patient H.M.\",\"slug\":\"case-study-2\",\"postDate\":1550183220,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p>Henry G. Molaison, <a href=\\\"http://patienthm.org\\\">Patient H.M.</a>, represents one of the most important cases in the history of neuropsychology. MetaCell worked with Dr. Jacopo Annese, Director at The Brain Observatory, to build a web application for the display of high value image data collected from the famous neuroscience patient.</p>\",\"34\":[\"27\"],\"1\":[],\"81\":[\"166\"],\"90\":\"https://www.youtube.com/watch?v=XkbauvReJFA\"}}','2019-02-19 05:44:37','2019-02-19 05:44:37','8e851e1a-4ee8-4c16-af0c-2315a6b60c77'),(238,193,2,1,1,3,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Patient H.M.\",\"slug\":\"netpyne-ui-1\",\"postDate\":1550554500,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p>Henry G. Molaison, <a href=\\\"http://patienthm.org\\\">Patient H.M.</a>, represents one of the most important cases in the history of neuropsychology. MetaCell worked with Dr. Jacopo Annese, Director at The Brain Observatory, to build a web application for the display of high value image data collected from the famous neuroscience patient.</p>\\n\",\"69\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download white paper\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"102\"},\"39\":[],\"83\":[\"168\"],\"37\":[\"194\"]}}','2019-02-19 05:45:32','2019-02-19 05:45:32','c12d674d-a083-4661-bacd-f61eb0c57594'),(239,193,2,1,1,4,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Patient H.M.\",\"slug\":\"netpyne-ui-1\",\"postDate\":1550554500,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p>Henry G. Molaison, <a href=\\\"http://patienthm.org\\\">Patient H.M.</a>, represents one of the most important cases in the history of neuropsychology. MetaCell worked with Dr. Jacopo Annese, Director at The Brain Observatory, to build a web application for the display of high value image data collected from the famous neuroscience patient.</p>\",\"69\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download white paper\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"102\"},\"39\":[],\"83\":[\"169\"],\"37\":[\"194\"]}}','2019-02-19 05:46:23','2019-02-19 05:46:23','317c1f11-4e2c-4bad-9038-ee23b4e2670a'),(240,24,2,1,1,11,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Virtual Fly Brain\",\"slug\":\"virtual-fly-brain\",\"postDate\":1549745520,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p><a href=\\\"http://www.metacell.us/VFBCaseStudy.html\\\">Virtual Fly Brain (VFB)</a> is an interactive tool for neurobiologists to explore the detailed neuroanatomy, neuron connectivity and gene expression of Drosophila melanogaster. It integrates data from published literature and image datasets making it possible to run cross searches, find similar neurons and compare image data on a <a href=\\\"http://www.metacell.us/VFBCaseStudy.html\\\">3D Viewer</a>.</p>\",\"69\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download Case Study\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"104\"},\"39\":[],\"83\":[\"168\"],\"37\":[\"98\"]}}','2019-02-19 05:46:32','2019-02-19 05:46:32','03fbe848-e1c8-4b0a-8dd3-2b2b6a0dc379'),(241,25,2,1,1,10,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"NetPyNE UI\",\"slug\":\"netpyne-ui\",\"postDate\":1549745520,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p><a href=\\\"http://netpyne.org/\\\">NetPyNE</a> is a python package to facilitate the development, parallel simulation and analysis of biological neuronal networks using the NEURON simulator. MetaCell significantly advanced the development of the <a href=\\\"https://github.com/MetaCell/NetPyNE-UI\\\">user interface of NetPyNE</a>, and recently released version 0.5.</p>\",\"69\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download Case Study\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"102\"},\"39\":[\"38\"],\"83\":[\"168\"],\"37\":[\"99\"]}}','2019-02-19 05:46:46','2019-02-19 05:46:46','6290220c-52bc-4bdd-94e8-591415c9f353'),(242,23,2,1,1,11,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Open Source Brain\",\"slug\":\"open-source-brain\",\"postDate\":1549745460,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p><a href=\\\"http://www.opensourcebrain.org/\\\">Open Source Brain</a> is an initiative by the Silver Lab at University College London to encourage collaborative development of models in computational neuroscience. MetaCell has worked with Open Source Brain to integrate <a href=\\\"http://www.geppetto.org/\\\">Geppetto</a> - an open source simulation platform - and enable neuroscientists to explore and run simulati