":[\"38\"],\"83\":[\"168\"],\"37\":[\"99\"]}}','2019-02-19 06:04:02','2019-02-19 06:04:02','b08540e9-c7a3-4765-92c2-616d9aba8794'),(252,199,8,1,1,1,'','{\"typeId\":\"8\",\"authorId\":\"1\",\"title\":\"The brain that change everything\",\"slug\":\"the-brain-that-change-everything-1\",\"postDate\":1550556600,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p>Pellentesque volutpat sed leo id posuere. Ut pulvinar diam eu elit consequat, non bibendum quam porttitor. Vivamus ullamcorper viverra nisi. Cras auctor magna risus, sed rhoncus velit venenatis vitae. Quisque venenatis enim in ligula rutrum, non consequat nunc rutrum. Nunc ultricies nunc nec congue congue. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Fusce eleifend ligula purus, sit amet facilisis massa imperdiet id. Morbi suscipit suscipit nisl, ac vestibulum ex auctor in. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla malesuada, urna sed porta blandit, erat dolor tincidunt risus, a accumsan erat nisi quis purus. Aenean id interdum ex. Vestibulum sodales consectetur ante, nec tristique lacus dapibus at. Phasellus suscipit ac dui id cursus. Aliquam lacinia pulvinar varius. Curabitur vitae pretium urna.</p><figure></figure><p>In summary, we have explored what it takes to create value from data in the 21st century in the area of neuroscience. We have seen that visualization is a powerful way to deal with multi-modal data, which is becoming the keystone of modern neuroscience R&amp;D. Furthermore, the creation of cross-disciplinary teams to evaluate and work with that data requires building collaborations that are enabled by powerful and context-heavy user interfaces. Lastly, we’ve seen that, in order to create such applications, key skill sets must converge: neuroscience experience, full-stack software engineering, and process control. </p><p>Organizations that learn these lessons of neuroscience data will end up with powerful, enabling software</p>\\n\\n\\n\\n\\n\\n\\n<p>technologies that will lead to the creation of high-value research.</p>\",\"45\":[\"97\"],\"91\":[\"82\",\"75\"],\"81\":[]}}','2019-02-19 06:10:08','2019-02-19 06:10:08','ee4a7721-04f2-4abd-8b9b-383d38e32ac4'),(253,123,10,1,1,29,'','{\"typeId\":\"14\",\"authorId\":\"1\",\"title\":\"Our Services\",\"slug\":\"our-services\",\"postDate\":1550308440,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"1\":{\"131\":{\"type\":\"pageTitle\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Our Services\",\"description\":\"We build cutting edge custom software for the neurosciences\",\"template\":\"default.twig\"}},\"180\":{\"type\":\"text\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"text\":\"<h2>MetaCell specialises in Data Exploration Software, Computational Software and Strategic Consulting.</h2>\",\"template\":\"fullWidth.twig\"}},\"133\":{\"type\":\"navigation\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"links\":{\"134\":{\"type\":\"2\",\"fields\":{\"image\":[\"41\"],\"linkTo\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Data Exploration Software\",\"target\":null,\"title\":null,\"type\":\"custom\",\"value\":\"#\"}}},\"135\":{\"type\":\"2\",\"fields\":{\"image\":[\"42\"],\"linkTo\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\" Computational Software\",\"target\":null,\"title\":null,\"type\":\"custom\",\"value\":\"#\"}}},\"136\":{\"type\":\"2\",\"fields\":{\"image\":[\"43\"],\"linkTo\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Strategic Consulting\",\"target\":null,\"title\":null,\"type\":\"custom\",\"value\":\"#\"}}}},\"template\":\"default.twig\"}},\"188\":{\"type\":\"spotlight\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Data Exploration Software\",\"icon\":[\"5\"],\"subheading\":null,\"description\":\"MetaCell provides the largest pharma companies in the world with a launchpad for building the pipelines you 