ds\":{\"items\":{\"152\":{\"type\":\"6\",\"fields\":{\"image\":[\"173\"],\"text\":\"<h4>Ask questions that nothing else today can answer</h4>\\n<ul><li>Where are genes expressed in the brain?</li><li>What connectivity patterns overlap with genes in the brain?</li><li>How does a biomarker derived from datscan correlate to how much patients pick up their right leg during walking?</li><li>How does Alzheimers and Parkinsons affect brain volume during disease progression?</li><li>What genes are differentially involved in human neuroscience disease?</li><li>What patient population is likely to have more Tau than average given high cortisol levels in a blood test?</li><li>What levels of white matter tract integrity are necessary in the indirect pathway of the basal ganglia for working memory?</li></ul>\"}},\"153\":{\"type\":\"6\",\"fields\":{\"image\":[\"175\"],\"text\":\"<h4>The world’s most valuable human neuroscience datasets, integrated with a powerful query and analytics engine</h4>\\n<ul><li>Allen Institute Human Brain Atlases</li><li>MNI Atlases</li><li>FSL Atlases</li><li>Interlex Knowledge Graph</li><li>ADNI</li><li>AIBL</li><li>PPMI</li><li>1000 functional connectomes</li><li>...and much more!</li></ul>\"}},\"154\":{\"type\":\"6\",\"fields\":{\"image\":[\"176\"],\"text\":\"<h4>Easily integrate your own datasets</h4>\\n<ul><li>Opinionated and semantically constrained integration of data</li><li>Semantic augmentation pipeline to process your compatible datasets</li></ul>\"}}},\"template\":\"default.twig\"}},\"156\":{\"type\":\"sectionTitle\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Feature set\",\"template\":\"default.twig\"}},\"179\":{\"type\":\"featureSet\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"image\":[\"177\"],\"text\":\"<ul><li>A powerful graphical interface to intuitively explore the world’s best data and ask novel questions</li><li>Support for all DICOM-based human neuroscience images, including all varieties of MRI, PET, DATSCAN, etc.</li><li>A knowledge graph embodying our common reference space and all relationships between the world’s best data and your own datasets</li><li>A query engine to translate your questions into reasoning rules capable of gathering new facts from the data</li><li>An analytics engine to let you process the data further to gain additional insights</li><li>A simulation engine to generate new predictions based on computational models that describe your hypothesis</li><li>Collaboratively produce beautiful well-referenced reports from the queries, analyses, and simulations you conducted for sharing with colleagues</li><li>A backend that can scale with your data while keeping it safe and secure</li><li>A subscription that will give you access to the latest datasets as soon as they are ingested</li><li>API and Client tool access for programmatic discovery</li><li>Secure Cloud based deployment or on-site</li><li>Compliant with HIPAA, FISMA, GDPR for simplified FDA reporting</li></ul>\",\"expandable\":true,\"linkTo\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":null},\"template\":\"right.twig\"}},\"157\":{\"type\":\"sectionTitle\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"What’s included in the platform?\",\"template\":\"default.twig\"}},\"159\":{\"type\":\"featureSet\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"image\":[\"177\"],\"text\":\"<ul><li>A powerful graphical interface to intuitively explore the world’s best data and ask novel questions</li><li>Support for all DICOM-based human neuroscience images, including all varieties of MRI, PET, DATSCAN, etc.</li><li>A knowledge graph embodying our common reference space and all relationships between the world’s best data and your own datasets</li><li>A query engine to translate your questions into reasoning rules capable of gathering new facts from the data</li><li>An analytics engine to let you process the data