gulation compliance, we require no training - you are guaranteed we will speak the same language from the get go. We eliminate all of the complexities of building robust software, and produce user experiences that are as functional as they are visually compelling.</p>\",\"secondCol\":\"<h6 class=\\\"title\\\">Our Neuroscience Data Exploration Software package includes:</h6>\\n<ul>\\n <li>Requirements gathering</li>\\n <li>Project management (including integration with in-house teams as needed)</li>\\n <li>Graphics, User Interface, and User Experience design<ul>\\n <li>Protocol integration</li>\\n <li>Workflow management</li>\\n <li>Data storage</li>\\n <li>Data synchronization</li>\\n <li>Data access and visualization</li>\\n <li>Programmatic API access</li></ul></li></ul>\\n<ul><li>Automated unit and integration testing</li><li>Production deployment</li></ul>\",\"template\":\"default.twig\"}},\"189\":{\"type\":\"spotlight\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Computational Software\",\"icon\":[\"6\"],\"subheading\":null,\"description\":\"MetaCell helps organizations big and small integrate your neuroscience data and build software that you can visualise on the web and easily share it, internally or with the public.\",\"button\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Request a quote\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"126\"},\"video\":[\"89\"],\"template\":\"leftIcon.twig\"}},\"161\":{\"type\":\"text2Cols\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"firstCol\":\"<h1>Features</h1>\\n<p>As a world-leading provider of custom web applications for neuroscience data visualization and sharing, we build your software for you, so you stop worrying about software engineering and focus on reaching your goals. </p>\",\"secondCol\":\"<h6 class=\\\"title\\\">Our Web Applications for Neuroscience Data Visualization and Sharing package includes:</h6>\\n<ul><li>Requirements gathering</li><li>Project management </li><li>Graphics, User Interface, and User Experience design </li><li>Software architecture design</li><li>High-quality, industry-standard custom-built software application for:<ul><li>Data storage and synchronization</li><li>Data access and visualisation</li></ul></li></ul>\\n<ul><li>Automated unit and integration testing</li><li>Production deployment</li></ul>\",\"template\":\"default.twig\"}},\"190\":{\"type\":\"spotlight\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Strategic Consulting\",\"icon\":[\"7\"],\"subheading\":null,\"description\":\"Data in neuroscience is generated at a tremendous rate. Knowing how to use it to produce the solutions you need requires crossover expertise from both computer engineering and biology.\",\"button\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Request a quote\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"126\"},\"video\":[\"92\"],\"template\":\"rightIcon.twig\"}},\"162\":{\"type\":\"text2Cols\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"firstCol\":\"<h6 class=\\\"title\\\">Building your scientific software platform<br /></h6>\\n<p>Is your organization facing barriers to your development work with critical neuroscience data?</p>\\n<h6 class=\\\"title\\\">Data integration</h6>\\n<p>Aligning, integrating, and delivering knowledge within and outside your organization can be a tremendous challenge. Our in-house expertise will enable you to cut through to the core of the challenge to provide robust and dependable solutions.<br /><br /></p>\",\"secondCol\":\"<h6 class=\\\"title\\\">Translational computational biology</h6>\\n<p>Get delivery of solidly engineered software that translate sciences discoveries into tangible solutions.<br /></p>\",\"template\":\"alignTop.twig\"}},\"137\":{\"type\":\"callToAction\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Let’s make something great together.\",\"description\":\"Let us know what challenges you are trying to solve so we can help.\",\"button\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Get in touch\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"126\"},\"template\":\"defaulr.twig\"}}}}}','2019-02-19 07:08:45','2019-02-19 07:08:45','2a2467d2-f1b1-40c4-9590-396d5d9a4536'),(264,106,10,1,1,16,'','{\"typeId\":\"14\",\"authorId\":\"1\",\"title\":\"Our Company\",\"slug\":\"our-company\",\"postDate\":1550304780,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"1\":{\"107\":{\"type\":\"pageTitle\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Our Company\",\"description\":\"We are the world leaders in software for neuroscience.\",\"template\":\"default.twig\"}},\"108\":{\"type\":\"text\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"text\":\"<h2>MetaCell is a software company that puts neuroscience data online, creating compelling visual and collaborative experiences.</h2>\\n<p>Our software applications unlock the true value of neuroscience data and models, including microscopy and MRI images, EEG and electrophysiology data, computer simulations, and much more.<br /></p>\",\"template\":\"fullWidth.twig\"}},\"113\":{\"type\":\"image\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"image\":[\"200\"],\"template\":\"default.twig\"}},\"110\":{\"type\":\"text\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"text\":\"<p>Since 2012 MetaCell\'s software applications have been helping leading organizations such as The Institute for Brain and Society, The European Bioinformatics Institute (EBI), Cohen Veterans Bioscience, The State University of New York, University College London (UCL), and The International Neuroinformatics Coordinating Facility.</p>\",\"template\":\"shiftedCentered.twig\"}},\"111\":{\"type\":\"sectionTitle\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Executive Team\",\"template\":\"default.twig\"}},\"109\":{\"type\":\"team\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"team\":[\"50\",\"52\",\"54\"],\"template\":\"default.twig\"}},\"114\":{\"type\":\"callToAction\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Let’s make something great together.\",\"description\":\"Let us know what challenges you are trying to solve so we can help.\",\"button\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Get in touch\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"126\"},\"template\":\"defaulr.twig\"}}}}}','2019-02-19 07:08:59','2019-02-19 07:08:59','941599d7-d340-4c42-8de1-5633ca5e1cc8'),(265,115,10,1,1,27,'','{\"typeId\":\"14\",\"authorId\":\"1\",\"title\":\"Our Platform\",\"slug\":\"our-platform\",\"postDate\":1550306640,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"1\":{\"116\":{\"type\":\"pageTitle\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Our Platform\",\"description\":\"We have deconstructed the world’s most valuable human neuroscience datasets\",\"template\":\"default.twig\"}},\"118\":{\"type\":\"text\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"text\":\"<h2>Our software applications unlock the true value of neuroscience data and models, including microscopy and MRI images, EEG and electrophysiology data, computer simulations, and much more.</h2>\\n<p>MetaCell’s neuroscience platform is a revolutionary system envisioned to accelerate drug development for neurological diseases and run virtual clinical trials. It will provide Pharma companies a computational environment for answering advanced questions about human neurology by harnessing the underlying shared anatomy of disparate human neuroscience datasets.</p>\",\"template\":\"fullWidth.twig\"}},\"119\":{\"type\":\"image\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"image\":[\"174\"],\"template\":\"default.twig\"}},\"120\":{\"type\":\"text\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"text\":\"<p>By creating a centralized model of experimental and clinical knowledge, hypotheses may be tested and prospective interventions may be simulated in the system itself, playing a critical supporting role in identifying appropriate targets for investment.</p>\",\"template\":\"shiftedCentered.twig\"}},\"155\":{\"type\":\"sectionTitle\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"What’s included in the platform?\",\"template\":\"default.twig\"}},\"150\":{\"type\":\"platformFeatures\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"items\":{\"152\":{\"type\":\"6\",\"fields\":{\"image\":[\"173\"],\"text\":\"<h4>Ask questions that nothing else today can answer</h4>\\n<ul><li>Where are genes expressed in the brain?</li><li>What connectivity patterns overlap with genes in the brain?</li><li>How does a biomarker derived from datscan correlate to how much patients pick up their right leg during walking?</li><li>How does Alzheimers and Parkinsons affect brain volume during disease progression?</li><li>What genes are differentially involved in human neuroscience disease?</li><li>What patient population is likely to have more Tau than average given high cortisol levels in a blood test?</li><li>What levels of white matter tract integrity are necessary in the indirect pathway of the basal ganglia for working memory?</li></ul>\"}},\"153\":{\"type\":\"6\",\"fields\":{\"image\":[\"175\"],\"text\":\"<h4>The world’s most valuable human neuroscience datasets, integrated with a powerful query and analytics engine</h4>\\n<ul><li>Allen Institute Human Brain Atlases</li><li>MNI Atlases</li><li>FSL Atlases</li><li>Interlex Knowledge Graph</li><li>ADNI</li><li>AIBL</li><li>PPMI</li><li>1000 functional connectomes</li><li>...and much more!</li></ul>\"}},\"154\":{\"type\":\"6\",\"fields\":{\"image\":[\"176\"],\"text\":\"<h4>Easily integrate your own datasets</h4>\\n<ul><li>Opinionated and semantically constrained integration of data</li><li>Semantic augmentation pipeline to process your compatible datasets</li></ul>\"}}},\"template\":\"default.twig\"}},\"156\":{\"type\":\"sectionTitle\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Feature set\",\"template\":\"default.twig\"}},\"179\":{\"type\":\"featureSet\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"image\":[\"177\"],\"text\":\"<ul><li>A powerful graphical interface to intuitively explore the world’s best data and ask novel questions</li><li>Support for all DICOM-based human neuroscience images, including all varieties of MRI, PET, DATSCAN, etc.</li><li>A knowledge graph embodying our common reference space and all relationships between the world’s best data and your own datasets</li><li>A query engine to translate your questions into reasoning rules capable of gathering new facts from the data</li><li>An analytics engine to let you process the data further to gain additional insights</li><li>A simulation engine to generate new predictions based on computational models that describe your hypothesis</li><li>Collaboratively produce beautiful well-referenced reports from the queries, analyses, and simulations you conducted for sharing with colleagues</li><li>A backend that can scale with your data while keeping it safe and secure</li><li>A subscription that will give you access to the latest datasets as soon as they are ingested</li><li>API and Client tool access for programmatic discovery</li><li>Secure Cloud based deployment or on-site</li><li>Compliant with HIPAA, FISMA, GDPR for simplified FDA reporting</li></ul>\",\"expandable\":true,\"linkTo\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":null},\"template\":\"right.twig\"}},\"157\":{\"type\":\"sectionTitle\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"What’s included in the platform?\",\"template\":\"default.twig\"}},\"159\":{\"type\":\"featureSet\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"image\":[\"205\"],\"text\":\"<ul><li>A powerful graphical interface to intuitively explore the world’s best data and ask novel questions</li><li>Support for all DICOM-based human neuroscience images, including all varieties of MRI, PET, DATSCAN, etc.</li><li>A knowledge graph embodying our common reference space and all relationships between the world’s best data and your own datasets</li><li>A query engine to translate your questions into reasoning rules capable of gathering new facts from the data</li><li>An analytics engine to let you process the data further to gain additional insights</li><li>A simulation engine to generate new predictions based on computational models that describe your hypothesis</li><li>Collaboratively produce beautiful well-referenced reports from the queries, analyses, and simulations you conducted for sharing with colleagues</li><li>A backend that can scale with your data while keeping it safe and secure</li><li>A subscription that will give you access to the latest datasets as soon as they are ingested</li><li>API and Client tool access for programmatic discovery</li><li>Secure Cloud based deployment or on-site</li><li>Compliant with HIPAA, FISMA, GDPR for simplified FDA reporting</li></ul>\",\"expandable\":true,\"linkTo\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":null},\"template\":\"left.twig\"}},\"121\":{\"type\":\"callToAction\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Let’s make something great together.\",\"description\":\"Let us know what challenges you are trying to solve so we can help.\",\"button\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Get in touch\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"126\"},\"template\":\"defaulr.twig\"}}}}}','2019-02-19 07:09:11','2019-02-19 07:09:11','4d928558-c526-4f8d-b715-c9ac24a02403'),(266,122,10,1,1,5,'','{\"typeId\":\"14\",\"authorId\":\"1\",\"title\":\"Our Portfolio\",\"slug\":\"our-portfolio\",\"postDate\":1550308380,\"expiryDate\":