om\",\"country_short\":\"GB\",\"postal_code\":\"SW1P 4QP\",\"postal_code_short\":\"SW1P 4QP\"},\"distance\":null},\"addressLine1\":\"30 Millbank Mill Street\",\"addressLine2\":\"Oxford, OX2 0HJ\",\"country\":\"United Kingdom\",\"phone\":\"+44 (0)74 475 40306\"}}},\"template\":\"default.twig\"}}}}}','2019-02-19 07:13:58','2019-02-19 07:13:58','ab4d8dc7-6e26-44f2-b1da-77c70aaaba11'),(270,24,2,1,1,12,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Virtual Fly Brain\",\"slug\":\"virtual-fly-brain\",\"postDate\":1549745520,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p><a href=\\\"http://metacell.petrovdev.eu/downloadable/case-study-3\\\">Virtual Fly Brain (VFB)</a> is an interactive tool for neurobiologists to explore the detailed neuroanatomy, neuron connectivity and gene expression of Drosophila melanogaster. It integrates data from published literature and image datasets making it possible to run cross searches, find similar neurons and compare image data on a <a href=\\\"http://www.metacell.us/VFBCaseStudy.html\\\">3D Viewer</a>.</p>\",\"69\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download Case Study\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"104\"},\"39\":[],\"83\":[\"168\"],\"37\":[\"98\"]}}','2019-02-19 07:17:53','2019-02-19 07:17:53','867e090e-2dd8-4075-8c85-85c86fff6f55'),(271,193,2,1,1,5,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Patient H.M.\",\"slug\":\"netpyne-ui-1\",\"postDate\":1550554500,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p>Henry G. Molaison, <a href=\\\"http://patienthm.org\\\">Patient H.M.</a>, represents one of the most important cases in the history of neuropsychology. MetaCell worked with Dr. Jacopo Annese, Director at The Brain Observatory, to build a web application for the display of high value image data collected from the famous neuroscience patient.</p>\",\"69\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download case study\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"102\"},\"39\":[],\"83\":[\"169\"],\"37\":[\"194\"]}}','2019-02-19 07:18:23','2019-02-19 07:18:23','74d64905-bb7b-45b7-b0fa-38219306de68'),(272,197,2,1,1,2,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"NEURON UI\",\"slug\":\"neuron-ui\",\"postDate\":1550555520,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p><a href=\\\"https://www.neuron.yale.edu/neuron/\\\">NEURON</a> is a widely used simulator in the neural multi-scale modelling domain, allowing models to be built that link reaction–diffusion dynamics at the molecular level, to neuronal electrophysiology, up to the large-scale network. MetaCell prototyped a <a href=\\\"https://github.com/metacell/neuron-ui\\\">new user interface</a> for NEURON using Geppetto.</p>\",\"69\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download case study \",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"101\"},\"39\":[],\"83\":[\"168\"],\"37\":[\"196\"]}}','2019-02-19 07:18:36','2019-02-19 07:18:36','17577e21-24c9-4439-bfcb-84c53f8469d6'),(273,197,2,1,1,3,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"NEURON UI\",\"slug\":\"neuron-ui\",\"postDate\":1550555520,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p><a href=\\\"https://www.neuron.yale.edu/neuron/\\\">NEURON</a> is a widely used simulator in the neural multi-scale modelling domain, allowing models to be built that link reaction–diffusion dynamics at the molecular level, to neuronal electrophysiology, up to the large-scale network. MetaCell prototyped a <a href=\\\"https://github.com/metacell/neuron-ui\\\">new user interface</a> for NEURON using Geppetto.</p>\",\"69\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download Case Study \",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"101\"},\"39\":[],\"83\":[\"168\"],\"37\":[\"196\"]}}','2019-02-19 07:18:52','2019-02-19 07:18:52','3aedf128-e14d-4fa9-b3a0-10055609d6d4'),(274,23,2,1,1,12,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Open Source Brain\",\"slug\":\"open-source-brain\",\"postDate\":1549745460,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p><a href=\\\"http://www.opensourcebrain.org/\\\">Open Source Brain</a> is an initiative by the Silver Lab at University College London to encourage collaborative development of models in computational neuroscience. MetaCell has worked with Open Source Brain to integrate <a href=\\\"http://www.geppetto.org/\\\">Geppetto</a> - an open source simulation platform - and enable neuroscientists to explore and run simulations of the latest computational models of neurons and networks developed in the scientific community.</p>\",\"69\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download Case Study \",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"103\"},\"39\":[\"39\",\"37\",\"36\"],\"83\":[\"168\"],\"37\":[\"100\"]}}','2019-02-19 07:19:06','2019-02-19 07:19:06','dfe3aa77-bd21-42ce-b6b2-64e24478bf01'),(275,193,2,1,1,6,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Patient H.M.\",\"slug\":\"netpyne-ui-1\",\"postDate\":1550554500,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p>Henry G. Molaison, <a href=\\\"http://patienthm.org\\\">Patient H.M.</a>, represents one of the most important cases in the history of neuropsychology. MetaCell worked with Dr. Jacopo Annese, Director at The Brain Observatory, to build a web application for the display of high value image data collected from the famous neuroscience patient.</p>\",\"69\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download Case Study \",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"102\"},\"39\":[],\"83\":[\"169\"],\"37\":[\"194\"]}}','2019-02-19 07:19:16','2019-02-19 07:19:16','f3a63ad4-9810-4c50-8745-103c6f30a832'),(276,195,2,1,1,3,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Pfizer Data Integration\",\"slug\":\"pfizer-data-integration\",\"postDate\":1550555280,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p><a href=\\\"https://www.pfizer.com/\\\">Pfizer</a> is investing in the creation of digital biomarkers, or signatures of disease states that can be detected from digital devices, to assist in the drug discovery R&amp;D process. MetaCell is building a system to transfer data collected from human subjects with wearable devices and other sensors into a database.</p>\",\"69\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download Case Study \",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"105\"},\"39\":[],\"83\":[\"170\"],\"37\":[\"100\"]}}','2019-02-19 07:19:25','2019-02-19 07:19:25','96d5bb12-53b2-4c5d-8924-0aa8aeb195cc'),(277,197,2,1,1,4,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"NEURON UI\",\"slug\":\"neuron-ui\",\"postDate\":1550555520,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p><a href=\\\"https://www.neuron.yale.edu/neuron/\\\">NEURON</a> is a widely used simulator in the neural multi-scale modelling domain, allowing models to be built that link reaction–diffusion dynamics at the molecular level, to neuronal electrophysiology, up to the large-scale network. MetaCell prototyped a <a href=\\\"https://github.com/metacell/neuron-ui\\\">new user interface</a> for NEURON using Geppetto.</p>\",\"69\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download Case Study \",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"101\"},\"39\":[\"38\"],\"83\":[\"168\"],\"37\":[\"196\"]}}','2019-02-19 07:19:53','2019-02-19 07:19:53','70918283-b20f-45fa-9670-b382192355e3'),(278,25,2,1,1,13,'','{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"NetPyNE UI\",\"slug\":\"netpyne-ui\",\"postDate\":1549745520,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p><a href=\\\"http://netpyne.org/\\\">NetPyNE</a> is a python package to facilitate the development, parallel simulation and analysis of biological neuronal networks using the NEURON simulator. MetaCell significantly advanced the development of the <a href=\\\"https://github.com/MetaCell/NetPyNE-UI\\\">user interface of NetPyNE</a>, and recently released version 0.5.</p>\",\"69\":{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Download Case Study\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":\"198\"},\"39\":[\"38\",\"36\"],\"83\":[\"168\"],\"37\":[\"99\"]}}','2019-02-19 07:20:26','2019-02-19 07:20:26','2f2f9417-383b-46a4-81f3-6dfd94592e22'),(279,198,9,1,1,3,'','{\"typeId\":\"13\",\"authorId\":\"1\",\"title\":\"NetPyNE UI\",\"slug\":\"net-py-ne-ui\",\"postDate\":1550183160,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p><a href=\\\"http://netpyne.org/\\\">NetPyNE</a> is a python package to facilitate the development, parallel simulation and analysis of biological neuronal networks using the NEURON simulator. MetaCell significantly advanced the development of the <a href=\\\"https://github.com/MetaCell/NetPyNE-UI\\\">user interface of NetPyNE</a>, and recently released version 0.5.</p>\",\"34\":[\"26\"],\"1\":[],\"81\":[\"166\"],\"90\":\"https://www.youtube.com/watch?v=XkbauvReJFA\"}}','2019-02-19 07:21:35','2019-02-19 07:21:35','49d0ed97-e41e-4c19-a14b-11ffbaeffabf'),(280,198,9,1,1,4,'','{\"typeId\":\"13\",\"authorId\":\"1\",\"title\":\"NetPyNE UI\",\"slug\":\"netpyne-ui\",\"postDate\":1550183160,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p><a href=\\\"http://netpyne.org/\\\">NetPyNE</a> is a python package to facilitate the development, parallel simulation and analysis of biological neuronal networks using the NEURON simulator. MetaCell significantly advanced the development of the <a href=\\\"https://github.com/MetaCell/NetPyNE-UI\\\">user interface of NetPyNE</a>, and recently released version 0.5.</p>\",\"34\":[\"26\"],\"1\":[],\"81\":[\"166\"],\"90\":\"https://www.youtube.com/watch?v=XkbauvReJFA\"}}','2019-02-19 07:24:34','2019-02-19 07:24:34','ee0208b9-65b5-4100-b15a-4dcb8298097b'),(281,101,9,1,1,5,'','{\"typeId\":\"13\",\"authorId\":\"1\",\"title\":\"NEURON UI\",\"slug\":\"neuron-ui\",\"postDate\":1550183160,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p><a href=\\\"https://www.neuron.yale.edu/neuron/\\\">NEURON</a> is a widely used simulator in the neural multi-scale modelling domain, allowing models to be built that link reaction–diffusion dynamics at the molecular level, to neuronal electrophysiology, up to the large-scale network. MetaCell prototyped a <a href=\\\"https://github.com/metacell/neuron-ui\\\">new user interface</a> for NEURON using Geppetto.</p>\",\"34\":[\"26\"],\"1\":[],\"81\":[\"166\"],\"90\":\"https://www.youtube.com/watch?v=XkbauvReJFA\"}}','2019-02-19 07:24:47','2019-02-19 07:24:47','1a71f6ab-f968-4679-a11c-42b19566d9c0'),(282,105,9,1,1,4,'','{\"typeId\":\"12\",\"authorId\":\"1\",\"title\":\"Pfizer Data Integration\",\"slug\":\"ppfizer-data-integration\",\"postDate\":1550183400,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p><a href=\\\"https://www.pfizer.com/\\\">Pfizer</a> is investing in the creation of digital biomarkers, or signatures of disease states that can be detected from digital devices, to assist in the drug discovery R&amp;D process. MetaCell is building a system to transfer data collected from human subjects with wearable devices and other sensors into a database.</p>\",\"34\":[\"27\"],\"1\":[],\"81\":[\"164\"],\"90\":\"https://www.youtube.com/watch?v=XkbauvReJFA\"}}','2019-02-19 07:25:02','2019-02-19 07:25:02','23d6ad08-dfc1-4c5d-9a82-57f1b75beb13'),(283,104,9,1,1,9,'','{\"typeId\":\"13\",\"authorId\":\"1\",\"title\":\"Virtual Fly Brain 2.0 Case Study\",\"slug\":\"virtual-fly-brain\",\"postDate\":1550183340,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p>Virtual Fly Brain is a joint effort of <strong>University of Edinburgh</strong>, <strong>LMB Cambridge</strong> and <strong>EBI</strong> - funded by the <strong>Wellcome Trust</strong> - to produce fly brain data-driven imaging, visualization and browsing. Using a 3D Brain Viewer, it is possible to explore the fruit fly anatomy and view image stacks from datasets integrated by Virtual Fly Brain.<br /></p>\\n<p>\\n</p>\\n<p>This <strong>in-depth, beautifully designed case study</strong> explains Virtual Fly Brain key features, what you can do with them, MetaCell\'s strategic role building the new version of VFB and its results. It\'s also packed with great visuals.</p>\\n<p>For any questions on Virtual Fly Brain, or to arrange a meeting with the MetaCell team, please email <a href=\\\"mailto:info@metacell.us\\\"><strong>info@metacell.us</strong></a> or call [US] +1 (347) 878 3679 or [UK] +44 (0)74 475 40306.</p>\",\"34\":[\"27\"],\"1\":{\"191\":{\"type\":\"sectionTitle\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Testimonials\",\"template\":\"default.twig\"}},\"181\":{\"type\":\"textSlider\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"slides\":{\"182\":{\"type\":\"7\",\"fields\":{\"text\":\"<p>\\\"It was great to work with MetaCell on expanding the Open Source Brain platform. They had an in-depth knowledge of the technologies involved, the scientific background and</p>\",\"author\":\"Dr. Padraig Gleeson, \\nSilver Lab, University College of London\"}},\"183\":{\"type\":\"7\",\"fields\":{\"text\":\"<p>\\\"It was great to work with MetaCell on expanding the Open Source Brain platform. They had an in-depth knowledge of the technologies involved, the scientific background and the project requirements. Their continuing contributions have made sure the platform is well designed, robust and provides an impressive user experience.\\\"</p>\",\"author\":\"Dr. Padraig Gleeson, \\nSilver Lab, University College of London\"}},\"184\":{\"type\":\"7\",\"fields\":{\"text\":\"<p>\\\"It was great to work with MetaCell on expanding the Open Source Brain platform. They had an in-depth knowledge of the technolplatform is well designed, robust and provides an impressive user experience.\\\"</p>\",\"author\":\"Dr. Padraig Gleeson, \\nSilver Lab, University College of London\"}}},\"template\":\"default.twig\"}}},\"81\":[\"166\"],\"90\":\"https://www.youtube.com/watch?v=XkbauvReJFA\"}}','2019-02-19 07:25:12','2019-02-19 07:25:12','73f0720e-8c1f-4f47-a9fa-563cafa7ddea'),(284,103,9,1,1,4,'','{\"typeId\":\"12\",\"authorId\":\"1\",\"title\":\"Open Source Brain Case Study\",\"slug\":\"open-source-brain\",\"postDate\":1550183280,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<p><a href=\\\"http://www.opensourcebrain.org/\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Open Source Brain</a> is a project of <strong>University College London</strong> - funded by the <strong>Wellcome Trust</strong> - to build a resource for sharing and collaboratively developing computational models of neural systems. Open Source Brain lets users explore and simulate computational models of neuronal networks and individual neurons.</p>\\n<p>This <strong>case study</strong> gives an overview of the key features of Open Source Brain and outlines MetaCell\'s role in building the current version of the tool.</p>\\n<p>For any questions on Open Source Brain, or to arrange a meeting with the MetaCell team, please email <a href=\\\"mailto:info@metacell.us\\\"><strong>info@metacell.us</strong></a> or call [US] +1 (347) 878 3679 or [UK] +44 (0)74 475 40306.</p>\",\"34\":[\"26\"],\"1\":[],\"81\":[\"164\"],\"90\":\"https://www.youtube.com/watch?v=XkbauvReJFA\"}}','2019-02-19 07:25:20','2019-02-19 07:25:20','ba6b1501-6201-4f7d-a7cb-da41fdccf1f5'),(285,102,9,1,1,6,'','{\"typeId\":\"13\",\"authorId\":\"1\",\"title\":\"Patient H.M.\",\"slug\":\"patien