>\\n\\n<p>Pellentesque volutpat sed leo id posuere. Ut pulvinar diam eu elit consequat, non bibendum quam porttitor. Vivamus ullamcorper viverra nisi. Cras auctor magna risus, sed rhoncus velit venenatis vitae. Quisque venenatis enim in ligula rutrum, non consequat nunc rutrum. Nunc ultricies nunc nec congue congue. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Fusce eleifend ligula purus, sit amet facilisis massa imperdiet id. Morbi suscipit suscipit nisl, ac vestibulum ex auctor in. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla malesuada, urna sed porta blandit, erat dolor tincidunt risus, a accumsan erat nisi quis purus. Aenean id interdum ex. Vestibulum sodales consectetur ante, nec tristique lacus dapibus at. Phasellus suscipit ac dui id cursus. Aliquam lacinia pulvinar varius. Curabitur vitae pretium urna.</p>\",\"45\":[\"96\"],\"91\":[\"75\",\"73\",\"83\"],\"81\":[\"163\"]}}','2019-02-19 08:46:26','2019-02-19 08:46:26','6d19335b-8760-4028-a315-ddebee03b71e'),(305,82,8,1,1,7,'','{\"typeId\":\"8\",\"authorId\":\"1\",\"title\":\"The brain that change everything\",\"slug\":\"the-brain-that-change-everything\",\"postDate\":1549256580,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<figure><img src=\\\"{asset:208:url}\\\" alt=\\\"\\\" /></figure>\\n<p>Neuroscience is a field of study that confronts some of the deepest mysteries that human beings have ever grappled with. What is the nature of our consciousness? What goes wrong when mental disease strikes? How do we heal injuries of the brain? While scientists have begun to answer these questions, many answers are still far from our grasp.</p>\\n\\n\\n\\n<p>From new molecular probes, to magnetic resonance imaging, to high-powered light and electron microscopes, to electrical recording, today, neuroscience is a discipline awash in data. While the field continues to devise increasingly powerful imaging and recording techniques, generating insight from these data now also requires pushing the limits of information science, mathematics, visualization, interaction, and software engineering. Why is this so complicated?</p><p>Because the brain itself is so intricate in structure and dynamics, no single method of data collection captures all of its functional aspects. In addition, to gather data from the brain, non-overlapping scientific disciplines such as physics, chemistry, electrical engineering, and genetics are required. As a result, experimental data is often collected from a single dimension of measurement. This means that as soon as the data are collected, they are already in need of being interpreted in the context of some other data. For example, scalp EEG data is collected from multiple electrodes, often with the need to have the exact positions of those electrodes on the head. Analogously, an image of brain tissue taken from a fiber-optic microscope often requires knowing the 3D location in the brain where the image was taken. In these cases and in many others, the context provided by a second or third modality of data is very often critical to deriving the full benefit from the first.</p>\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n<p><br /></p><p><br /></p>\",\"45\":[\"96\"],\"91\":[\"75\",\"73\",\"83\"],\"81\":[\"163\"]}}','2019-02-19 08:48:35','2019-02-19 08:48:35','71a8ea60-967f-4a90-8970-cee0f24f6236'),(306,82,8,1,1,8,'','{\"typeId\":\"8\",\"authorId\":\"1\",\"title\":\"The brain that change everything\",\"slug\":\"the-brain-that-change-everything\",\"postDate\":1549256580,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"31\":\"<figure><img src=\\\"{asset:208:url}\\\" alt=\\\"\\\" /></figure>\\n<p>Neuroscience is a field of study that confronts some of the deepest mysteries that human beings have ever grappled with. What is the nature of our consciousness? What goes wrong when mental disease strikes? How do we heal injuries of the brain? While scientists have b