ra, per inceptos himenaeos. Fusce eleifend ligula purus, sit amet facilisis massa imperdiet id. Morbi suscipit suscipit nisl, ac vestibulum ex auctor in. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla malesuada, urna sed porta blandit, erat dolor tincidunt risus, a accumsan erat nisi quis purus. Aenean id interdum ex. Vestibulum sodales consectetur ante, nec tristique lacus dapibus at. Phasellus suscipit ac dui id cursus. Aliquam lacinia pulvinar varius. Curabitur vitae pretium urna.</p><figure></figure>\\n<figure></figure>\\n<figure></figure>\\n<figure></figure>\\n<p>In summary, we have explored what it takes to create value from data in the 21st century in the area of neuroscience. We have seen that visualization is a powerful way to deal with multi-modal data, which is becoming the keystone of modern neuroscience R&amp;D. Furthermore, the creation of cross-disciplinary teams to evaluate and work with that data requires building collaborations that are enabled by powerful and context-heavy user interfaces. Lastly, we’ve seen that, in order to create such applications, key skill sets must converge: neuroscience experience, full-stack software engineering, and process control. </p>\\n<p>Organizations that learn these lessons of neuroscience data will end up with powerful, enabling software</p>\\n<p>technologies that will lead to the creation of high-value research.</p>\",\"45\":[\"97\"],\"91\":[\"82\",\"75\"],\"81\":[]}}','2019-02-19 17:30:40','2019-02-19 17:30:40','c04a540a-e144-4f81-bf22-5792bbce43a8'),(313,209,11,1,1,1,'','{\"typeId\":\"15\",\"authorId\":\"1\",\"title\":\"Navigate MetaCell\",\"slug\":\"navigate-metacell\",\"postDate\":1550810220,\"expiryDate\":null,\"enabled\":true,\"newParentId\":\"\",\"fields\":[]}','2019-02-22 04:37:20','2019-02-22 04:37:20','d467b76b-411e-464e-98a0-b40d50442270'),(314,210,11,1,1,1,'','{\"typeId\":\"16\",\"authorId\":\"1\",\"title\":\"Pharma Companies\",\"slug\":\"pharma-companies\",\"postDate\":1550810340,\"ex