,'2019-02-16 17:19:21','2019-02-27 04:39:37','0474c2fd-d939-4a07-ab81-c3e5fef242e1',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'What’s included in the platform?','default.twig',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(51,159,1,'2019-02-16 17:59:03','2019-02-27 04:39:37','37f9ca2e-67ff-4189-881e-d1046406e994',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<ul><li>A powerful graphical interface to intuitively explore the world’s best data and ask novel questions</li><li>Support for all DICOM-based human neuroscience images, including all varieties of MRI, PET, DATSCAN, etc.</li><li>A knowledge graph embodying our common reference space and all relationships between the world’s best data and your own datasets</li><li>A query engine to translate your questions into reasoning rules capable of gathering new facts from the data</li><li>An analytics engine to let you process the data further to gain additional insights</li><li>A simulation engine to generate new predictions based on computational models that describe your hypothesis</li><li>Collaboratively produce beautiful well-referenced reports from the queries, analyses, and simulations you conducted for sharing with colleagues</li><li>A backend that can scale with your data while keeping it safe and secure</li><li>A subscription that will give you access to the latest datasets as soon as they are ingested</li><li>API and Client tool access for programmatic discovery</li><li>Secure Cloud based deployment or on-site</li><li>Compliant with HIPAA, FISMA, GDPR for simplified FDA reporting</li></ul>','left.twig','{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":null}',NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL),(52,160,1,'2019-02-16 19:29:46','2019-02-27 04:39:37','40cd0286-739c-4f08-99b2-d3407e714bf9',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<h1>Features</h1>\n<p>With our unique understanding of drug pre-clinical and clinical trials, neuroscience, software engineering and regulation compliance, we require no training - you are guaranteed we will speak the same language from the get go. We eliminate all of the complexities of building robust software, and produce user experiences that are as functional as they are visually compelling.</p>','<h6 class=\"title\">Our Neuroscience Data Exploration Software package includes:</h6>\n<ul>\n <li>Requirements gathering</li>\n <li>Project management (including integration with in-house teams as needed)</li>\n <li>Graphics, User Interface, and User Experience design<ul>\n <li>Protocol integration</li>\n <li>Workflow management</li>\n <li>Data storage</li>\n <li>Data synchronization</li>\n <li>Data access and visualization</li>\n <li>Programmatic API access</li></ul></li></ul>\n<ul><li>Automated unit and integration testing</li><li>Production deployment</li></ul>','default.twig',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(53,161,1,'2019-02-17 06:21:12','2019-02-27 04:39:37','9d8e5749-ff07-4213-959e-1a80f80a5e36',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<h1>Features</h1>\n<p>As a world-leading provider of custom web applications for neuroscience data visualization and sharing, we build your software for you, so you stop worrying about software engineering and focus on reaching your goals. </p>','<h6 class=\"title\">Our Web Applications for Neuroscience Data Visualization and Sharing package includes:</h6>\n<ul><li>Requirements gathering</li><li>Project management </li><li>Graphics, User Interface, and User Experience design </li><li>Software architecture design</li><li>High-quality, industry-standard custom-built software application for:<ul><li>Data storage and synchronization</li><li>Data access and visualisation</li></ul></li></ul>\n<ul><li>Automated unit and integration testing</li><li>Production deployment</li></ul>','default.twig',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(54,162,1,'2019-02-17 06:27:31','2019-02-27 04:39:37','5700f21e-0583-4aa7-8ec4-f9b72fe47033',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<h6 class=\"title\">Building your scientific software platform<br /></h6>\n<p>Is your organization facing barriers to your development work with critical neuroscience data?</p>\n<h6 class=\"title\">Data integration</h6>\n<p>Aligning, integrating, and delivering knowledge within and outside your organization can be a tremendous challenge. Our in-house expertise will enable you to cut through to the core of the challenge to provide robust and dependable solutions.<br /><br /></p>','<h6 class=\"title\">Translational computational biology</h6>\n<p>Get delivery of solidly engineered software that translate sciences discoveries into tangible solutions.<br /></p>','alignTop.twig',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(55,167,1,'2019-02-17 11:00:48','2019-02-27 04:39:38','c3a46b97-1c38-4798-901c-4c0745618602',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'default.twig',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(56,171,1,'2019-02-17 17:50:20','2019-02-27 04:39:37','1635488f-6554-4fcd-aabb-284fe3861bf3',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,