INSERT INTO `metac_stc_14_items` VALUES (1,152,1,'2019-02-16 16:46:30','2019-02-27 04:39:37','a7e4d4f4-e5f5-493a-9dfb-ecfba3ab14c8','<h4>Ask questions that nothing else today can answer</h4>\n<ul><li>Where are genes expressed in the brain?</li><li>What connectivity patterns overlap with genes in the brain?</li><li>How does a biomarker derived from datscan correlate to how much patients pick up their right leg during walking?</li><li>How does Alzheimers and Parkinsons affect brain volume during disease progression?</li><li>What genes are differentially involved in human neuroscience disease?</li><li>What patient population is likely to have more Tau than average given high cortisol levels in a blood test?</li><li>What levels of white matter tract integrity are necessary in the indirect pathway of the basal ganglia for working memory?</li></ul>'),(2,153,1,'2019-02-16 16:46:30','2019-02-27 04:39:37','88b6c2a1-0df8-41ff-ba83-2bbb33cd8b3f','<h4>The world’s most valuable human neuroscience datasets, integrated with a powerful query and analytics engine</h4>\n<ul><li>Allen Institute Human Brain Atlases</li><li>MNI Atlases</li><li>FSL Atlases</li><li>Interlex Knowledge Graph</li><li>ADNI</li><li>AIBL</li><li>PPMI</li><li>1000 functional connectomes</li><li>...and much more!</li></ul>'),(3,154,1,'2019-02-16 16:46:30','2019-02-27 04:39:37','5f57bc24-ba47-41c2-9111-bc5c2d3f8ae5','<h4>Easily integrate your own datasets</h4>\n<ul><li>Opinionated and semantically constrained integration of data</li><li>Semantic augmentation pipeline to process your compatible datasets</li></ul>');
/*!40000 ALTER TABLE `metac_stc_14_items` ENABLE KEYS */;
UNLOCK TABLES;
commit;

